INSERT INTO `about` (`id`, `title`, `description`, `slug`, `lang`) VALUES
(1, 'Why DNAsbook Digital Marketing?', '<h1>&nbsp;</h1>\r\n\r\n<p>Why opportunity &quot;4&quot;? Where the idea of Opportunity &quot;5&quot; came from? Thomas, CEO/Founder of Opportunity &quot;4&quot; was listening to an African president one day in his early teenage years and the president said something that changed his life! The president was giving a speech on how Africans can help each other, how best they can help someone in need! Answering his own question, he gave an example....</p>\r\n\r\n<p>He said the best way to help someone in need of fish to survive is &quot;not bringing fishes to the person everyday but is to bring the person to the fish&quot;. This means that the best way to help someone is to make sure that after the help the person becomes independent, can be able to take care of himself and help other people to care of themselves too. That speech becomes the &quot;father&quot; of Opportunity &quot;4&quot; today. How?</p>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?v=aBgU01nIDSY\" target=\"_blank\">Watch This Video</a></p>\r\n\r\n<p>&nbsp;</p>', 'why-dnasbook-digital-marketing', 'en'),
(3, 'Pourquoi l\'Opportunité \"4\"?', '<h2 style=\"font-style:italic\">&nbsp;</h2>\r\n\r\n<p>D&#39;o&ugrave; vient l&#39;id&eacute;e d&#39;Opportunit&eacute; &quot;5&quot;? Thomas, PDG / fondateur d&rsquo;Opportunity &quot;4&quot;, &eacute;coutait un pr&eacute;sident africain un jour dans son adolescence et ce dernier a dit quelque chose qui a chang&eacute; sa vie! Le pr&eacute;sident pronon&ccedil;ait un discours sur la mani&egrave;re dont les Africains peuvent s&#39;entraider, comment mieux aider les personnes dans le besoin! R&eacute;pondant &agrave; sa propre question, il a donn&eacute; un exemple ...</p>\r\n\r\n<p>Il a d&eacute;clar&eacute; que la&nbsp;meilleure fa&ccedil;on&nbsp;d&#39;aider une personne qui a&nbsp;besoin de poisson pour&nbsp;survivre est &quot;de ne pas lui apporter du&nbsp;poisson chaque&nbsp;les jour&nbsp;mais&nbsp;l&#39;amener au&nbsp;&nbsp;poisson&quot;. Cela signifie que la&nbsp;meilleure fa&ccedil;on&nbsp;d&rsquo;aider une personne est de s&rsquo;assurer qu&rsquo;apr&egrave;s l&rsquo;aide, que cette personne devienne&nbsp;autonome et capable de prendre soin d&#39;elle-m&ecirc;me. Ce discours devient le &quot;p&egrave;re&quot; de Opportunity &quot;4&quot; aujourd&#39;hui. Comment?</p>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?v=9yUlpyhWS-w&amp;t=15s\">Regarde cette video</a>!</p>', 'pourquoi-l-opportunit-4', 'fr');
