INSERT INTO `companies_profiles` (`id`, `name`, `company_moto`, `description`, `company_description_title`, `address`, `contact`, `email`, `company_image_title`, `photo_url`, `user_id`, `created_at`) VALUES
(1, 'Simple Prabidhi', 'Why Over-complicate ?', '<p><strong>Simple Prabidhi&nbsp;</strong>is&nbsp;small but growing and&nbsp;ambitious web development and mobile application development company. We provide quality sofware solutions for your business problem. We are a self displined team that is dedicated to meeting the deadline.&nbsp;&nbsp;</p>\r\n\r\n<p>Our team handles every project with personal care. Our designs not only reflect your business objectives but also help drive your business.</p>\r\n\r\n<p>We provide you sofware products that are highly suited to your custom needs.</p>', 'Company  Descriptions', 'Thapathali', '9808417239', 'a@a.com', 'Images Gallery', 'https://www.dnasbookdigimarket.com/uploads/back_photo/20180718_170752_20180718_121006_office.jpg', 1, NULL),
(3, 'DNAsbook', 'Results Are Guaranteed!', '<p>At Opportunity &quot;4&quot;, we know that everybody or almost everybody needs financial help to realize his dreams, this means everybody has dreams, desires or whatever you call it but most of time, it is money that blocks all this! Listen, we have help here for you to meet your financial needs, whether you believe it or not, it is true what you are reading! In fact, we don&#39;t need your believe to help you with your financial needs! Just take the actions we are going to ask you and leave the rest to us! We are not going to ask you money, only actions, we are giving you money, not you giving us money! Is it clear? Now let&#39;s go!</p>', 'DNAsbook General', '160 Grumman Ave, Apt 207 Newark NJ 07112', '908 249 7637', 'yahiadjipe@yahoo.com', 'DNAsbook General', 'https://www.dnasbookdigimarket.com/uploads/back_photo/20180723_153457_wanderurlaub-grossarl-wanderhotel-alte-post-5-1900x700.jpg', 2, NULL),
(4, NULL, NULL, NULL, 'Description', NULL, NULL, NULL, 'Company Images', NULL, 6, NULL),
(5, NULL, NULL, NULL, 'Description', NULL, NULL, NULL, 'Company Images', NULL, 5, NULL),
(6, 'DNAsbook', 'Results Are Guaranteed!', '<p>Why Opportunity &quot;4&quot;? Where the idea of Opportunity &quot;4&quot; came from? Thomas, CEO/Founder of Opportunity &quot;4&quot; was listening to an African president one day in his early teenage years and the president said something that changed his life! The president was giving a speech on how Africans can help each other, how best they can help someone in need! Answering his own question, he gave an example....</p>\r\n\r\n<p>He said the best way to help someone in need of fish to survive is &quot;not bringing fishes to the person everyday but is to bring the person to the fish&quot;. This means that the best way to help someone is to make sure that after the help the person becomes independent, can be able to take care of himself and help other people to care of themselves too. That speech becomes the &quot;father&quot; of Opportunity &quot;4&quot; today.</p>\r\n\r\n<p>Mr KITTAH KODJO, nous avons remarqu&eacute; que depuis un certain temps, vous avez de probl&egrave;mes &agrave; payer vos loyers et ceci devient de plus en plus chronique.&nbsp;</p>\r\n\r\n<p>vous &ecirc;tes en retard de 2 mois sur le paiement de vos loyers maintenant, en effet nos dossiers nous indiquent que vous n&rsquo;avez pas pay&eacute; les loyers de Fevrier 2018 et Juin 2018. ceci est une preuve ind&eacute;niable que vous trouvez de plus en plus difficile de payer vos loyers. Vous ne pouvez pas &ecirc;tre dans nos locaux sans paiement de loyers pendant 2 mois.</p>\r\n\r\n<p>Vu la situation, nous vous donnons un delai de 3&nbsp; mois, du 1er Juillet 2018 au 30 Septembre 2018 pour lib&eacute;rer la chambre. A cette date (30 Septembre 2018), vous auriez br&ucirc;l&eacute; 24 000 cfa (3 mois de loyers (Juillet, Aout et Septembre 2018) dans les 6 mois de guarantie. Il vous restera alors 24 000 cfa &agrave; cette date si la chambre est laiss&eacute;e dans de bonnes conditions.&nbsp;</p>\r\n\r\n<p>Ce pr&eacute;avis est irr&eacute;versible et nous vous d&eacute;mandons de prendre vos dispositions pour sortir &agrave; cette date (30 Septembre 2018), faute de quoi, nous serons oblig&eacute;s de vous sortir de la chambre par force &agrave; vos frais; dans ce cas, le contrat d&rsquo;expulsion vous sera appliqu&eacute; dans toute sa force.</p>\r\n\r\n<p>Selon les termes du contrat de location (Articles 15, 17, 19 et 20), vos devez vider les lieux, remettre les cl&eacute;s et les locaux inspect&eacute;s avant toute remise du reste de caution. Tout dommage caus&eacute; &agrave; la chambre qui ne ressort pas d&rsquo;une usure normale, comme vous le savez, doit &ecirc;tre r&eacute;par&eacute; &agrave; vos frais, donc dans le reste de votre caution avant de vous remettre le reste. Toute chambre laiss&eacute;e non-nettoy&eacute;e est nettoy&eacute;e au frais du locataire.&nbsp;</p>\r\n\r\n<p>Si vous avez des questions, adressez-vous &agrave; Mr Kpetigo, Tel. 90 30 30 94.&nbsp;</p>\r\n\r\n<p>Depuis d&eacute;cembre 2017, des conflits entre les Hemas et les Lendus, deux communaut&eacute;s vivant dans la province d&rsquo;Ituri situ&eacute;e dans le nord-est du Congo, ont fait de nombreux morts et ont pouss&eacute; des dizaines de milliers de personnes &agrave; se d&eacute;placer. Parmi les victimes de cette escalade de violence, on compte de nombreux T&eacute;moins de J&eacute;hovah.</p>\r\n\r\n<p>Des milliers de r&eacute;fugi&eacute;s congolais ont fui en Ouganda pour &eacute;chapper aux troubles, y compris 192&nbsp;T&eacute;moins vivant dans deux camps de r&eacute;fugi&eacute;s pr&egrave;s de la fronti&egrave;re congolaise. En juin 2018, 1&nbsp;098&nbsp;autres T&eacute;moins ont fui la zone de conflit et se sont rendus &agrave; Bunia, capitale de l&rsquo;Ituri. Malheureusement, un couple ainsi que trois jeunes enfants de T&eacute;moins sont morts en raison de complications de sant&eacute;. Toutefois, aucun de nos fr&egrave;res et s&oelig;urs n&rsquo;a &eacute;t&eacute; tu&eacute; lors des massacres.</p>\r\n\r\n<p><a href=\"https://assetsnffrgf-a.akamaihd.net/assets/m/702018152/univ/wpub/702018152_univ_cnt_01_xl.jpg\" target=\"_blank\"><img src=\"https://assetsnffrgf-a.akamaihd.net/assets/m/702018152/univ/wpub/702018152_univ_cnt_01_lg.jpg\" /></a></p>\r\n\r\n<p>Salle d&rsquo;assembl&eacute;es de Bunia&nbsp;: Photo de fr&egrave;res et s&oelig;urs lendus qui ont fui diff&eacute;rentes r&eacute;gions de l&rsquo;Ituri.</p>\r\n\r\n<p>Les maisons de nombreux T&eacute;moins qui ont fui le conflit ont &eacute;t&eacute; pill&eacute;es ou enti&egrave;rement br&ucirc;l&eacute;es. De plus, un grand nombre de leurs cultures, qui constituent leur principale source de revenu, ont &eacute;t&eacute; d&eacute;truites.</p>\r\n\r\n<p>Depuis le d&eacute;but des combats, les T&eacute;moins vivant en dehors de la zone de conflit apportent une aide pratique &agrave; leurs fr&egrave;res sinistr&eacute;s. Certains ont pr&ecirc;t&eacute; leur v&eacute;hicule pour que leurs fr&egrave;res et s&oelig;urs soient &eacute;vacu&eacute;s en lieu s&ucirc;r (voir photo ci-dessus). En outre, malgr&eacute; leurs moyens limit&eacute;s, 205&nbsp;familles T&eacute;moins de Bunia ont fourni argent, nourriture et logement &agrave; leurs fr&egrave;res r&eacute;fugi&eacute;s. Bien que les deux camps de r&eacute;fugi&eacute;s de Bunia aient une grande capacit&eacute; d&rsquo;accueil, tous les T&eacute;moins d&eacute;plac&eacute;s sont h&eacute;berg&eacute;s par des membres de l&rsquo;assembl&eacute;e locale (<a href=\"https://www.jw.org/fr/publications/bible/nwt/livres/proverbes/17/#v20017017\" target=\"_blank\">Proverbes 17:17</a>).</p>\r\n\r\n<p>Le Comit&eacute; de la filiale du Congo a mis en place un comit&eacute; de secours pour fournir des produits de premi&egrave;re n&eacute;cessit&eacute; &agrave; nos fr&egrave;res et s&oelig;urs. Un repr&eacute;sentant de la filiale a aussi rendu visite aux T&eacute;moins sinistr&eacute;s pour leur apporter des encouragements &agrave; l&rsquo;aide de la Bible.</p>\r\n\r\n<p>M&ecirc;me s&rsquo;ils ont d&ucirc; fuir le Congo, les fr&egrave;res et s&oelig;urs r&eacute;fugi&eacute;s &agrave; Bunia, ou dans d&rsquo;autres r&eacute;gions, continuent d&rsquo;assister aux offices des assembl&eacute;es locales et de parler activement aux autres de la bonne nouvelle. Entre f&eacute;vrier et avril 2018, plus de 270&nbsp;cours bibliques ont &eacute;t&eacute; commenc&eacute;s dans les camps de r&eacute;fugi&eacute;s.</p>\r\n\r\n<p>Nous prions J&eacute;hovah pour qu&rsquo;il continue de donner &agrave; nos fr&egrave;res et s&oelig;urs du Congo la paix de l&rsquo;esprit et pour qu&rsquo;il b&eacute;nisse les op&eacute;rations de secours en faveur des sinistr&eacute;s. Nous attendons tous avec impatience le jour o&ugrave; le royaume de Dieu viendra et procurera &agrave; tous les serviteurs de J&eacute;hovah une s&eacute;curit&eacute; durable et &laquo;&nbsp;un endroit paisible&nbsp;&raquo; (<a href=\"https://www.jw.org/fr/publications/bible/nwt/livres/Isa%C3%AFe/32/#v23032017-v23032018\" target=\"_blank\">Isa&iuml;e 32:17, 18</a>).</p>\r\n\r\n<p>&nbsp;</p>', 'Our Company Description and Our Affiliate Link', '160 Grumman Ave, Apt 207 Newark NJ 07112', '908 249 7637', 'yahiadjipe@yahoo.com', 'Our Products!', 'https://www.dnasbookdigimarket.com/uploads/back_photo/20180817_224757_for-header-6811-2000-x-800.jpg', 7, NULL),
