INSERT INTO `material` (`id`, `group_id`, `sub_group_id`, `title`, `slug`, `description`, `material_type`, `video_url`, `embed`, `course_url`, `price`, `payment_type`, `enable_payment_button`, `paypal_plan_id`, `created_at`, `updated_at`, `thumbnail_url`) VALUES
(102, 18, 21, '1) Pourquoi l\'Opporunté \"4\"?', '1-pourquoi-l-opporunte-4', '<p>Pourquoi Opportunity &quot;4&quot;? Pour d&eacute;couvrir pourquoi Opportunity &quot;4&quot; a &eacute;t&eacute; cr&eacute;&eacute; et comment en profiter maintenant, lisez ce cours en texte!</p>', 'COURSE', 'https://www.dnasbookdigimarketafrica.com/uploads/materials', '', 'https://www.dnasbookdigimarketafrica.com/pages/1a-pourquoi-opportunite-4', 0.00, 'ONE TIME', 'YES', NULL, '2019-01-13 19:21:47', '2019-01-13 19:21:47', 'https://www.dnasbookdigimarketafrica.com/uploads/thumbnails/20190113_142147_WhyOpportunity4Textfcais.jpg'),
(103, 17, 20, '2) We pay your monthly fees!', '2-we-pay-your-monthly-fees', '<p>We pay your monthly fees! See how we do that!</p>', 'COURSE', 'https://www.dnasbookdigimarketafrica.com/uploads/materials', '', 'https://www.dnasbookdigimarketafrica.com/pages/2a-we-pay-your-monthly-fees', 0.00, 'ONE TIME', 'YES', NULL, '2019-01-14 05:39:05', '2019-01-14 05:39:05', 'https://www.dnasbookdigimarketafrica.com/uploads/thumbnails/20190114_003905_Monthly feesText.jpg'),
(104, 18, 21, '2) Nous payons vos frais mensuels!', '2-nous-payons-vos-frais-mensuels', '<p>Nous payons vos frais mensuels! Voyez comment nous faisons cela!</p>', 'COURSE', 'https://www.dnasbookdigimarketafrica.com/uploads/materials', '', 'https://www.dnasbookdigimarketafrica.com/pages/2a-nous-payons-vos-frais-mensuels', 0.00, 'ONE TIME', 'YES', NULL, '2019-01-14 05:41:33', '2019-01-14 05:43:10', 'https://www.dnasbookdigimarketafrica.com/uploads/thumbnails/20190114_004310_We pay your fees monthly2.jpg'),
(101, 17, 20, '1) Why Opportunity \"4\"?', '1-why-opportunity-4', '<p>Why Opportunity &quot;4&quot;? To discover why Opportunity &quot;4&quot; was created and how to can profit from it now, read this course in text!</p>', 'COURSE', 'https://www.dnasbookdigimarketafrica.com/uploads/materials', '', 'https://www.dnasbookdigimarketafrica.com/pages/1a-why-opportunity-4', 0.00, 'ONE TIME', 'YES', NULL, '2019-01-13 19:06:47', '2019-01-13 19:14:09', 'https://www.dnasbookdigimarketafrica.com/uploads/thumbnails/20190113_141409_WhyOpportunity4Text.jpg'),
(85, 17, 20, '1) Automated Webinar', '1-automated-webinar', '<p>This Online Webinar will show you where the idea of Opportunity &quot;4&quot; came from, Why the idea of Opportunity &quot;4&quot; and How you can benefit from it Now!</p>', 'VIDEO', 'https://www.dnasbookdigimarketafrica.com/uploads/materials/Opportunity4EnglishAfricaWebinarII.mp4', '<div style=\'position:relative;height:0;padding-bottom:56.25%\'><iframe class=\'sproutvideo-player\' src=\'https://videos.sproutvideo.com/embed/d49ddfb21d1de5c05c/e52144e6faee575a?playerTheme=dark&amp;playerColor=2f3437\' style=\'position:absolute;width:100%;height:100%;left:0;top:0\' frameborder=\'0\' allowfullscreen></iframe></div>', NULL, 0.00, 'ONE TIME', 'YES', NULL, '2019-01-04 21:56:13', '2019-02-04 07:16:30', 'https://www.dnasbookdigimarketafrica.com/uploads/thumbnails/20190204_021630_Automated Webinar.jpg'),
(86, 18, 21, '1) Séminaire Automatique en Ligne.', '1-seminaire-automatique-en-ligne', '<p>Ce Webinaire en ligne vous montrera d&rsquo;o&ugrave; est venue l&rsquo;id&eacute;e de l&#39;Opportunit&eacute; &quot;4&quot;, pourquoi l&rsquo;id&eacute;e de l&#39;Opportunit&eacute; &quot;4&quot; et comment en tirer profit Maintenant!</p>', 'VIDEO', 'https://www.dnasbookdigimarketafrica.com/uploads/materials/Opportunity4FrenchAfricaWebinarll.mp4', '<div style=\'position:relative;height:0;padding-bottom:56.25%\'><iframe class=\'sproutvideo-player\' src=\'https://videos.sproutvideo.com/embed/4c9ddfb21d1deac9c4/ee90f90f6a983d04?playerTheme=dark&amp;playerColor=2f3437\' style=\'position:absolute;width:100%;height:100%;left:0;top:0\' frameborder=\'0\' allowfullscreen></iframe></div>', NULL, 0.00, 'ONE TIME', 'YES', NULL, '2019-01-04 22:05:30', '2019-02-04 07:20:37', 'https://www.dnasbookdigimarketafrica.com/uploads/thumbnails/20190204_022037_Automated Webinarfr.jpg'),
