INSERT INTO `news` (`id`, `title`, `slug`, `description`, `created_at`, `updated_at`, `lang`) VALUES
(3, 'Why Opportunity \"4\"?', 'why-opportunity-4', '<p>Why Opportunity &quot;4&quot;? Where the idea of Opportunity &quot;4&quot; came from? Thomas, CEO/Founder of Opportunity &quot;4&quot; was listening to an African president one day in his early teenage years and the president said something that changed his life! The president was giving a speech on how Africans can help each other, how best they can help someone in need! Answering his own question, he said this:</p>\r\n\r\n<p>The best way to help someone in need of fish to survive is &quot;not bringing fishes to the person everyday but is to bring the person to the fish&quot;. This means that the best way to help someone is to make sure that after the help the person becomes independent, can be able to take care of himself and help other people to care of themselves too. That speech becomes the &quot;father&quot; of Opportunity &quot;4&quot; today.</p>', NULL, NULL, 'en'),
(4, 'Pourquoi Opportunity \"4\"?', 'pourquoi-opportunity-4', '<p>Pourquoi Opportunity &quot;4&quot;? D&#39;o&ugrave; vient l&#39;id&eacute;e de l&#39;opportunit&eacute; &quot;4&quot;? Thomas, PDG / fondateur d&rsquo;Opportunity &quot;4&quot;, &eacute;coutait un pr&eacute;sident africain un jour dans son adolescence et ce dernier a dit quelque chose qui a chang&eacute; sa vie! Le pr&eacute;sident pronon&ccedil;ait un discours sur la mani&egrave;re dont les Africains peuvent s&#39;entraider, comment mieux aider les personnes dans le besoin! R&eacute;pondant &agrave; sa propre question, il dit ceci:</p>\r\n\r\n<p>Le meilleur moyen d&rsquo;aider une personne qui a besoin de poisson &agrave; survivre est &quot;de ne pas apporter de poisson &agrave; la personne tous les jours, mais bien de l&rsquo;amener &agrave; la p&ecirc;che&quot;. Cela signifie que le meilleur moyen d&rsquo;aider une personne est de s&rsquo;assurer qu&rsquo;apr&egrave;s l&rsquo;aide, cette personne devient autonome et capable de prendre soin de elle-m&ecirc;me et d&rsquo;aider les autres &agrave; se soigner &eacute;galement. Ce discours devient le &quot;p&egrave;re&quot; de Opportunity &quot;4&quot; aujourd&#39;hui.</p>', NULL, NULL, 'fr');
