(9, 'PUBLISHED', 5, 'Why Opportunity  4 was created', 'why-opportunity-4-was-created', '<h1><strong>Why Opportunity &quot;4&quot;?</strong></h1>\r\n\r\n<p>Why Opportunity &quot;4&quot;? Where the idea of Opportunity &quot;4&quot; came from? I&nbsp;was listening to an African president one day in his early teenage years and the president said something that changed his life! The president was giving a speech on how Africans can help each other, how best they can help someone in need! Answering his own question, he gave an example....</p>\r\n\r\n<p>He said the best way to help someone in need of fish to survive is &quot;not bringing fishes to the person everyday but is to bring the person to the fish&quot;. How can you bring someone to the fish? You bring someone to the fish if you bring the person to&nbsp;the river, to the see or to wherever you fish and teach&nbsp;the person how to fish himself, that is the&nbsp;best way to help someone. If you help someone this way, after the help, the person becomes independent, can be able to take care of himself and help other people to care of themselves too. That speech becomes the &quot;father&quot; of Opportunity &quot;4&quot; today. How?</p>\r\n\r\n<p>In my tennage years, acquiring good education was the goal with the believe that good education automatically gives good job, future etc... Unfortunately, we quickly realized that it was not the case! People went to school but could not find job. Why? The government was and is still today the principal source of jobs with better benefits. The private sector was not and is still not today developed. People was discouraged and left school. Results: Poverty!&nbsp;</p>\r\n\r\n<p>I began thinking of a possible solution..... And I happened to come to USA. When looking for possible reasons why USA is so economically powerful, I noticed the private sector specially the entrepreneurship. This particularly retains my attention because if we can develop the private sector in Africa through entrepreneurship, our financial problems might find serious solutions if not resolved. It is&nbsp;thinking about this that I came up with Opportunity &quot;4&quot;. It is American entrepeneurship &quot;africanized&quot; to the point that I even eliminate for users the monthly fee&nbsp;payments (they are generated by the system for the users). All this is possible by using a famous rule I invented: Rule 20/20.</p>\r\n\r\n<p>With rule 20/20 applied to Opportunity &quot;4&quot;, you can be able to generate $842 100 at the end of your 4th month entering the system. If you follow rule 20/20 as explained, the $842 100 are guaranteed at the end of the 4th month! <a href=\"http://www.dnasbookdigimarket.com/user-academy/view/15\">Watch this video to see how!</a></p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, 'PAGE', 'NO SIDEBAR', '2018-07-11 12:27:10', '2018-11-01 20:12:08', 'fr'),
(10, NULL, NULL, 'Pourquoi Opportunity \"4\"?', 'pourquoi-opportunity-4', '<p>Pourquoi Opportunity &quot;4&quot;? D&#39;o&ugrave; vient l&#39;id&eacute;e de l&#39;opportunit&eacute; &quot;4&quot;? Thomas, PDG / fondateur d&rsquo;Opportunity &quot;4&quot;, &eacute;coutait un pr&eacute;sident africain un jour dans son adolescence et ce dernier a dit quelque chose qui a chang&eacute; sa vie! Le pr&eacute;sident pronon&ccedil;ait un discours sur la mani&egrave;re dont les Africains peuvent s&#39;entraider, comment mieux aider les personnes dans le besoin! R&eacute;pondant &agrave; sa propre question, il dit ceci:</p>\r\n\r\n<p>Le meilleur moyen d&rsquo;aider une personne qui a besoin de poisson &agrave; survivre est &quot;de ne pas apporter de poisson &agrave; la personne tous les jours, mais bien de l&rsquo;amener &agrave; la p&ecirc;che&quot;. Cela signifie que le meilleur moyen d&rsquo;aider une personne est de s&rsquo;assurer qu&rsquo;apr&egrave;s l&rsquo;aide, cette personne devient autonome et capable de prendre soin de elle-m&ecirc;me et d&rsquo;aider les autres &agrave; se soigner &eacute;galement. Ce discours devient le &quot;p&egrave;re&quot; de Opportunity &quot;4&quot; aujourd&#39;hui.</p>', NULL, NULL, 'BLOCK', NULL, '2018-11-03 01:46:01', '2018-11-03 01:46:01', 'fr'),
(11, NULL, NULL, 'Why Opportunity \"4\"?', 'why-opportunity-4', '<p>Why Opportunity &quot;4&quot;? Where the idea of Opportunity &quot;4&quot; came from? Thomas, CEO/Founder of Opportunity &quot;4&quot; was listening to an African president one day in his early teenage years and the president said something that changed his life! The president was giving a speech on how Africans can help each other, how best they can help someone in need! Answering his own question, he said this:</p>\r\n\r\n<p>The best way to help someone in need of fish to survive is &quot;not bringing fishes to the person everyday but is to bring the person to the fish&quot;. This means that the best way to help someone is to make sure that after the help the person becomes independent, can be able to take care of himself and help other people to care of themselves too. That speech becomes the &quot;father&quot; of Opportunity &quot;4&quot; today.</p>', NULL, NULL, 'BLOCK', NULL, '2018-11-03 01:46:43', '2018-11-03 01:46:43', 'en'),
(12, 'PUBLISHED', NULL, 'Terms and conditions', 'terms-and-conditions', '<p style=\"margin-left:0px; margin-right:0px\">As a Opportunity &quot;4&quot; Affiliate, You have the opportunity to earn money from the monthly fees of the subscribers you bring to the training. This Agreement sets forth Your rights and obligations as a Opportunity &quot;4&quot; Affiliate. By clicking &ldquo;I Agree&rdquo; You indicate that You have read and understood this Agreement and You will be bound by its terms.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">1. PARTIES. All references to &ldquo;Opportunity &quot;4&quot;&rdquo; herein mean and refer to DNAsbook General, LLC, doing business as Opportunity &quot;4&quot;, and DNAsbook General, LLC&#39;s owner(s), parent company(ies), affiliate entities, and employees, and assigns. All references to &ldquo;You&rdquo; and &ldquo;Your&rdquo; mean and refer to that Opportunity &quot;4&quot; Affiliate who has executed this Agreement by clicking &ldquo;I Agree.&rdquo; Opportunity &quot;4&quot; and You are each referred to herein as a &ldquo;Party,&rdquo; and collectively as the &ldquo;Parties.&rdquo;</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">2. INDEPENDENT CONTRACTOR. You are an independent contractor of Opportunity &quot;4&quot;. It is the express understanding and intention of the Parties that no relationship of master and servant or principal and agent shall exist between Opportunity &quot;4&quot; and You by virtue of this Affiliate Agreement.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">3. TERM AND TERMINATION. Your contract with Opportunity &quot;4&quot; begins when You click &ldquo;I Agree,&rdquo; and will continue month-to-month until either:</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">A. Opportunity &quot;4&quot; cancels Your account due to Your breach of any of the terms of this Agreement. In the event this Agreement is cancelled due to Your breach, You forfeit all Commissions and Bonuses owed to You or that may in the future be owed to You.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">or</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">B. Opportunity &quot;4&quot; or its successors or assigns, in its sole and absolute discretion, cancels Your Affiliate Agreement. In the event that Opportunity &quot;4&quot; or its successors or assigns cancels Your Affiliate Agreements, a written notice will be sent to the e-mail address you provided Opportunity &quot;4&quot; and that is associated with your Affiliate profile.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">4. COMPENSATION.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">A. COMMISSIONS. After You click &ldquo;I Agree&rdquo; to the terms of this Agreement, You will receive a unique Affiliate URL, which You will use to advertise Opportunity &quot;4&quot;. There are 4 levels of benefits in Opportunity &ldquo;4&rdquo;, if a user registers directly on Affiliate URL, that subscriber will be placed directly at your Level 1. The users who subscribe on your Level 1 subscribers Affiliate URL will be placed on your Level 2. The users who subscribe on your Level 2 subscribers Affiliate URL will be placed on your Level 3. The users who subscribe on your Level 3 subscribers Affiliate URL will be placed on your Level 4. Level 4 is the end of your benefits. The users who subscribe on your Level 4 subscribers Affiliate URL do not belong to you, you don&rsquo;t benefit from their fees. Every month, Opportunity &ldquo;4&rdquo; gives you 40% of the total fees collected at your 4 levels, because there are 4 levels, you get 10% of commission from each subscriber at each of the 4 levels. The commissions will be paid to you according to the means of payment you chose, the country you live in and other conditions.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">B. BONUSES. We have bonuses for subscribers. Learn more about these bonuses here! Watch this video for more explanations!</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">C. TAXES. Before You can be paid any Commission or Bonuses, You must provide Opportunity &quot;4&quot; a completed W-8 or W-9, as instructed by Opportunity &quot;4&quot;. You will be deemed to have permanently waived all rights to Commissions or Bonuses that were earned more than 30 days before submitting a completed W-8 or W-9 to Opportunity &quot;4&quot;. You are responsible for any and all tax liabilities, including without limitation income tax liabilities that arise from or in any way relate to any commissions or bonuses You receive from Opportunity &quot;4&quot;. If You are not a resident of the United States, Opportunity &quot;4&quot; may withhold tax (including without limitation VAT) where required to by applicable law. Where Opportunity &quot;4&quot; is required to withhold tax, Opportunity &quot;4&quot; will document such withholding.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">D. MINIMUM COMMISSION AND BONUS PAYMENT. Your combined commission and bonus amount must equal or exceed two thousands francs&nbsp;(2000 FCFA) before You receive a payment from Opportunity &quot;4&quot;. If Your combined commissions and bonuses for a given month are less than $50.00, Your commissions and bonuses will be held until Your combined commissions and bonuses equals or exceeds 2000 FCFA.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">E. COMMISSION AND BONUSES. Commissions and Bonuses are paid only for received by Opportunity &quot;4&quot;. If the fee is not actually received by Opportunity &quot;4&quot;, You will not be paid a Commission. If fees in an Account later results in a refund or charge-back, and if a commission or bonus was paid to You on that fee, then the commission or bonus will be deducted from Your future commissions. If Opportunity &quot;4&quot; determines, in its reasonable discretion, that any fee was paid fraudulently or as a result of any violation of this Agreement, no Commission or Bonus will be paid for such fees. If any Commissions or Bonuses are paid from a fee that was produced fraudulently or as a result of any violation of this Agreement, and the fraud or violation is discovered by Opportunity &quot;4&quot; after payment, such payment amounts shall be deducted from Your future commissions and bonuses and the account deleted.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">F. U.S. DOLLARS. All commissions are paid in US Dollars via PayPal or check.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">5. MARKETING AND RECRUITING.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">A. TRUTHFUL. Anything You communicate in marketing or advertising any Opportunity &quot;4&quot; service or opportunity must be true and accurate. Claims that relate to any Opportunity &quot;4&quot; service or opportunity that are untrue or fraudulent are strictly prohibited. You may not claim that any government, person, or entity endorses or supports Opportunity &quot;4&quot;. You may not use the intellectual property of any other person or entity in advertising any Opportunity &quot;4&quot; service or opportunity.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">B. DISCLAIMER. On any website that You advertise any Opportunity &ldquo;4&rdquo; service or opportunity, You must plainly display (i.e., not in a link, or in small font) the following disclaimer language:</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">Disclosure: I am an independent Opportunity &quot;4&quot; Affiliate, not an employee. I receive referral payments from Opportunity &quot;4&quot;. The opinions expressed here are my own and are not official statements of Opportunity &quot;4&quot; or its parent company, DNAsbook General, LLC.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">C. NON-DISPARAGEMENT. You are not permitted to disparage the products of services of any other person or entity, including without limitation the products or services of a competitor of Opportunity &quot;4&quot;.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">D. INVENTORY LOADING/REBATES. You will not be paid any Commission or Bonus for payments made on your own User Account(s). You are not permitted to open an Opportunity &quot;4&quot; account under the name of another person or entity, or under a fictitious name. You are not permitted to open an Opportunity &quot;4&quot; account under any name merely for the purpose of obtaining Commissions, Bonuses, or any other compensation, including without limitation incentives or prizes which may be offered from time to time. Violation of this paragraph shall constitute a material breach of this Agreement, and You agree to repay to Opportunity &quot;4&quot; all Commissions and Bonuses earned as a result of any such violation.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">E. INCOME CLAIMS. If Your recruiting efforts include claims related to the potential income an Opportunity &quot;4&quot; Affiliate can make, or if You make reference to income You have made, or if You make reference to any lifestyle opportunities You have because of Opportunity &quot;4&quot;, the following guidelines must be adhered to:</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">1. Your statements must be completely true and accurate and supported by evidence;</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">2. If You use a hypothetical scenario, You must clearly label it as a hypothetical scenario; and</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">3. Your statements must be accompanied by the Opportunity &quot;4&quot; income disclosure statement.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">6. Opportunity &quot;4&quot;&rsquo; INTELLECTUAL PROPERTY. No logo, tagline, trademark, trade name, copyrighted material, patent, trade dress, trade secret, or confidential information (collectively, the &ldquo;Opportunity &quot;4&quot; Intellectual Property&rdquo;) owned by Opportunity &quot;4&quot; may be used, copied, or reproduced by You except as set forth below. No Opportunity &quot;4&quot; Intellectual Property (or any mark confusingly similar to any Opportunity &quot;4&quot; Intellectual Property) is to be advertised for sale or registered as a domain name by You in any fashion.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">You may use the Opportunity &quot;4&quot;TM mark to advertise Opportunity &quot;4&quot;. Any time You use the Opportunity &quot;4&quot;TM mark, You must do so in a way that is not likely to confuse readers or cause them to think that You are speaking for Opportunity &quot;4&quot;. Whether Your use of Opportunity &quot;4&quot;TM is confusing will be determined by Opportunity &quot;4&quot; in Opportunity &quot;4&quot;&rsquo; sole and absolute discretion. The following guidelines, which may be changed or added to at any time, are designed to help avoid reader confusion:</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- You must not use the &ldquo;voice&rdquo; of, or purport to speak on behalf of, Opportunity &quot;4&quot;.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- Any time You use the word &ldquo;Opportunity &quot;4&quot;&rdquo; it must be immediately followed by the letters &ldquo;TM&rdquo; in superscript caps.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- When used in prose, Opportunity &quot;4&quot;TM must be used in the same font as the rest of the prose.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- When used other than in prose, Opportunity &quot;4&quot;TM must be used in the font employed by Opportunity &quot;4&quot;&rsquo; corporate marketing in Opportunity &quot;4&quot;&rsquo; corporate logo.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- On any website or social media platform on which You use the word Opportunity &quot;4&quot;TM, you must include the disclosure identified in paragraph 5(D) above.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- You may use only such other images, photographs, and trademarks as Opportunity &quot;4&quot; expressly authorizes in writing.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- If you have any questions regarding your use of any Opportunity &quot;4&quot; mark, please contact: yahiadjipe@yahoo.com</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">7. RELEASE/AUTHORIZATION TO USE PHOTOGRAPHS. You grant Opportunity &quot;4&quot; permission to use any and all photographs taken by Opportunity &quot;4&quot; or its agents or employees, or submitted by You to Opportunity &quot;4&quot; (hereinafter &ldquo;Photographs&rdquo;) in any Media (including print, internet, film, television and no matter how distributed or published) for any purpose, which may include, but shall not be limited to, advertising, promotion, marketing and packaging of Opportunity &quot;4&quot; or any product or service sold and marketed by Opportunity &quot;4&quot;. You agree that this authorization to use Photographs may be assigned by Opportunity &quot;4&quot; to any other party. You agree that that the Photographs may be combined with other Photographs, sounds, text and graphics, and that the Photographs may be manipulated, cropped, altered or modified in Opportunity &quot;4&quot;&rsquo; sole discretion. You agree not to charge a royalty or fee, and not to make any other monetary assessment against Opportunity &quot;4&quot; in exchange for this Release and Assignment. You hereby release and forever discharge Opportunity &quot;4&quot; from any and all liability and from any damages You may suffer as a result of the use of the Photographs. You further acknowledge and agree that this Release is binding upon Your heirs and assigns. You agree that this Release is irrevocable.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">8. PROHIBITED ACTIVITY. Opportunity &quot;4&quot; has the right to terminate this Agreement at any time if You engage or have ever engaged in any of the following:</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">A. HARMFUL ACTS. Any dishonest or unethical business practice; any violation of the law; infliction of harm to DNAsbook General, LLC&#39;s reputation; and the violation of the rights of Opportunity &quot;4&quot; or any third party.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">B. &ldquo;SPAMMING&rdquo; AND UNSOLICITED COMMUNICATIONS. Any communications sent or authorized by You reasonably deemed &ldquo;spamming,&rdquo; or any other unsolicited solicitations (including without limitation postings on social media or third party blogs) will be deemed a material threat to DNAsbook General, LLC&#39;s reputation and to the rights of third parties. It is Your obligation, exclusively, to ensure that all business communications comply with state and local anti-spamming or analogous laws.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">C. OFFENSIVE COMMUNICATIONS. Any communication sent, posted, or authorized by You, including without limitation postings on any website operated by You, or social media or blog, which are: sexually explicit, obscene, or pornographic; offensive, profane, hateful, threatening, harmful, defamatory, libelous, harassing, or discriminatory; graphically violent; solicitous of unlawful behavior; or that violates the intellectual property rights of another.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">9. INDEMNITY. You agree to protect, defend, indemnify and hold harmless Opportunity &quot;4&quot;, its officers, directors, employees, owner(s), and parent company(ies) and assigns from and against all claims, demands, and causes of action of every kind and character without limit arising out of the Your conduct. Your indemnity obligation includes, but is not limited to, any third party claim against Opportunity &quot;4&quot; for liability for payments for, damages caused by, or other liability relating to, You.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">10. NO WARRANTY; NO LEADS. Opportunity &quot;4&quot; does not promise, guarantee or warrant Your business success, income, or sales. You understand and acknowledge that Opportunity &quot;4&quot; will not at any time provide sales leads or referrals to You. Additionally, Opportunity &quot;4&quot;&rsquo; WEBSITES AND SERVICES ARE PROVIDED &ldquo;AS IS&rdquo; WITHOUT WARRANTY OF ANY KIND, EITHER EXPRESS OR IMPLIED, INCLUDING WITHOUT LIMITATION IMPLIED WARRANTIES OF TITLE, MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. Opportunity &quot;4&quot; MAKES NO REPRESENTATION OR WARRANTY AS TO THE ACCURACY, RELIABILITY, TIMELINESS OR COMPLETENESS OF ANY MATERIAL ON OR ACCESSIBLE THROUGH ANY Opportunity &quot;4&quot; WEBSITE OR SERVICE. ANY RELIANCE ON OR USE OF SUCH MATERIALS SHALL BE AT YOUR SOLE RISK. Opportunity &quot;4&quot; MAKES NO REPRESENTATION OR WARRANTY (A) THAT ANY Opportunity &quot;4&quot; WEBSITE OR SERVICE WILL BE AVAILABLE ON A TIMELY BASIS, OR THAT ACCESS TO ANY Opportunity &quot;4&quot; WEBSITE OR SERVICE WILL BE UNINTERRUPTED, ERROR-FREE OR SECURE; (B) THAT DEFECTS OR ERRORS WILL BE CORRECTED; OR (C) THAT ANY Opportunity &quot;4&quot;&rsquo; WEBSITE OR THE SERVERS OR NETWORKS THROUGH WHICH ANY Opportunity &quot;4&quot;&rsquo; WEBSITE IS MADE AVAILABLE ARE SECURE OR FREE OF VIRUSES OR OTHER HARMFUL COMPONENTS. APPLICABLE LAW MAY NOT ALLOW THE EXCLUSION OF IMPLIED WARRANTIES, SO THE ABOVE EXCLUSION MAY NOT APPLY TO YOU.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">11. LIMITATION OF LIABILITY. YOU AGREE THAT IN NO EVENT SHALL Opportunity &quot;4&quot;&rsquo; LIABILITY TO YOU FOR ANY CLAIM OF ANY KIND OR DESCRIPTION EXCEED THE AMOUNT OF THREE (3) TIMES THE COMMISSIONS AND BONUS PAYMENTS PAID TO YOU FOR THE MONTH PRECEDING THE DATE IN WHICH THE FACTS GIVING RISE TO A CLAIM AGAINST Opportunity &quot;4&quot; OCCURRED. YOU WAIVE ANY RIGHT TO SPECIAL, INDIRECT OR CONSEQUENTIAL DAMAGES OF ANY KIND OR DESCRIPTION.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">12. FORCE MAJEURE. Opportunity &quot;4&quot; will not be responsible to You for any delay, damage, or failure caused by or occasioned by a Force Majeure Event. As used in this Agreement, &ldquo;Force Majeure Event&rdquo; shall mean: any act of God, act of nature or the elements, terrorism, insurrection, revolution or civil strife, piracy, civil war or hostile action, labor strikes, acts of public enemies, federal or state laws, rules and regulations of any governmental authorities having jurisdiction over the premises, inability to procure material, equipment, or necessary labor in the open market, acute and unusual labor, material, or equipment shortages, or any other causes beyond the control of Opportunity &quot;4&quot;. Delays due to any of the above causes shall not be deemed to be a breach of or failure to perform under this Agreement. Opportunity &quot;4&quot; shall not be required against its will to adjust any labor or other similar dispute except in accordance with applicable law.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">13. ASSIGNMENT. Opportunity &quot;4&quot; may assign its rights under this Agreement at any time, without notice to You. Your rights arising under this Agreement cannot be assigned by without Opportunity &quot;4&quot;&rsquo; or its assigns express written consent.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">14. ARBITRATION, GOVERNING LAW, AND ATTORNEYS&rsquo; FEES.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">A. ARBITRATION. Any claim or grievance of any kind, nature or description that You have against Opportunity &quot;4&quot; including, but not limited to, economic losses, personal injury, or property damage, shall be resolved exclusively in binding arbitration in Essex county, Newark, NJ. You agree not to file suit against Opportunity &quot;4&quot; or any of its affiliates, subsidiaries, officers, directors, employees, successors, or assigns. The arbitration will take place before a neutral arbitrator (hereafter, &ldquo;Arbitrator&rdquo;) agreed upon by You and Opportunity &quot;4&quot;. In the event that You and Opportunity &quot;4&quot; are unable to reach agreement on an Arbitrator, You and Opportunity &quot;4&quot; will each select an arbitrator, and the two of them will select the Arbitrator, who must be a resident of Essex county, Newark, NJ. The arbitrators selected by You and Opportunity &quot;4&quot; will have no further involvement in the arbitration. The Arbitrator will determine the rules governing arbitration. The decision of the Arbitrator will be final and binding on You and Opportunity &quot;4&quot; and may be reduced to a judgment in any court of competent jurisdiction. This agreement to arbitrate survives any termination or expiration of the Agreement.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">B. GOVERNING LAW. This Agreement shall be governed, construed, and interpreted in accordance with the laws of the State of New Jersey without regard to any choice of law provisions.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">C. WAIVER OF CLASS ACTION CLAIMS. You understand and agree that You will not have the right to participate in a representative capacity or as a member of any class of claimants pertaining to any claims that may arise under, or be in any way related to, this Agreement. There is no right or authority for any claim You have against Opportunity &quot;4&quot; to be brought on a class action basis or on any basis involving claims brought in a purported representative capacity on behalf of the general public, or on behalf of other persons or entities similarly situated. Claims brought against Opportunity &quot;4&quot; may not be joined or consolidated with claims brought by anyone else.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">D. LIMITATIONS PERIOD. Any claim brought in arbitration must be brought within the time period set forth in any statute of limitations that, but for this agreement to arbitrate, would apply to the claims asserted in any arbitration proceeding.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">E. INJUNCTIVE RELIEF. Nothing in this Agreement prevents Opportunity &quot;4&quot; from applying to and obtaining from any court having jurisdiction a temporary injunction, preliminary injunction, permanent injunction, or other relief available to protect Opportunity &quot;4&quot;&rsquo; rights prior to, during, or following any arbitration proceeding.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">F. ATTORNEYS&rsquo; FEES. You agree that in the event of any arbitration or litigation, each Party will each bear its own costs and attorneys&rsquo; fees, regardless of who is deemed the prevailing party. The foregoing notwithstanding, if either Your or Opportunity &quot;4&quot; commences an action in a court of law or equity and the responding Party successfully moves such court to compel arbitration, the Party who moved for the order compelling arbitration shall be entitled to recover its reasonable costs and attorneys&rsquo; fees incurred on the motion to compel from the other Party.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">G. REFUND: There is no fees refund when paid. Why? Your monthly fees payment is for your access to our online training program. These fees are paid monthly for services you have been consuming on our site and other sources of information. If you don&#39;t want to pay the monthly fees anymore, just cancel your account or just wait for a month without paying and your account will be locked automatically.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">H. FEE PAYMENTS: No one is allowed to pay his fees to any employee in our offices around the world. Our monthly fees are paid online on our site or paid by our subscribers personally or through someone on one of our bank accounts indicated for him in his area. Any fees paid to anyone in our offices will be at risk of the payer, that fee will demanded from the subscriber or his account blocked, his commissions suspended according to our policies.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">15. ENTIRE AGREEMENT. This Agreement, along with Opportunity &quot;4&quot;&rsquo; standard Terms and Conditions represents the entire agreement between the Parties and supersede any other written or oral agreement between the Parties as pertaining to Your rights and responsibilities as a Opportunity &quot;4&quot; Affiliate.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">16. MODIFICATION/AMENDMENTS. This Agreement and Opportunity &quot;4&quot;&rsquo; standard Terms and Conditions may be modified by Opportunity &quot;4&quot; at any time, with or without prior notice to You. Amendments or Modifications to this Agreement or the Terms and Conditions will be binding on You when they are sent to You via e-mail, or are posted in the affiliate center. No amendment to this Agreement or the Terms and Conditions shall be valid unless authored or signed by Opportunity &quot;4&quot;. Your continued acceptance of Commission or Bonus payments constitutes Your acceptance to any modifications or amendments to this Agreement.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">17. NO WAIVER. No waiver by Opportunity &quot;4&quot; of any right reserved or granted to Opportunity &quot;4&quot; under this Agreement shall be effective unless the waiver is in writing and signed by an authorized representative of Opportunity &quot;4&quot;.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">18. NOTICE. Any notice required to be given to Opportunity &quot;4&quot; under or related to this Agreement shall be in writing, addressed as follows:</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">DNAsbook General, LLC</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">160 Grumman Ave, #207</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">Newark, NJ 07112</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">yahiadjipe@yahoo.com</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">Opportunity &quot;4&quot; will send notices to You at the e-mail address You provided to Opportunity &quot;4&quot;. Any notices shall be deemed delivered to You when sent by Opportunity &quot;4&quot;. You are solely responsible for addressing any technical failures related to Your e-mail address or server, and for reading any e-mail sent to You.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">19. SEVERANCE. In the event any provision of this Agreement is inconsistent with or contrary to any applicable law, rule, or regulation, the provision shall be deemed to be modified to the extent required to comply with the law, rule, or regulation, and this Agreement and the Terms and Conditions, as so modified, shall continue in full force and effect.</p>', NULL, NULL, 'PAGE', 'NO SIDEBAR', '2018-12-12 21:17:17', '2018-12-13 02:41:23', 'en');
