(13, 'PUBLISHED', NULL, 'Terms and conditions', 'terms-and-conditions', '<p style=\"margin-left:0px; margin-right:0px\">En tant qu&rsquo;affili&eacute; de l&rsquo;Opportunity &quot;4&quot;, vous avez la possibilit&eacute; de gagner de l&rsquo;argent gr&acirc;ce aux frais mensuels des abonn&eacute;s que vous apportez &agrave; la formation. Le pr&eacute;sent contrat d&eacute;finit vos droits et obligations en tant qu&rsquo;affili&eacute; de l&rsquo;opportunit&eacute; &quot;4&quot;. En cliquant sur &laquo;J&#39;accepte&raquo;, vous indiquez que vous avez lu et compris le pr&eacute;sent contrat et que vous serez li&eacute; par ses conditions.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">1. PARTIES. Toutes les r&eacute;f&eacute;rences &agrave; &quot;Opportunit&eacute;&quot; 4 &quot;&quot; dans le pr&eacute;sent document signifient et font r&eacute;f&eacute;rence &agrave; DNAsbook General, LLC, faisant affaire sous le nom de Opportunity &quot;4&quot;, et au (x) propri&eacute;taire (s), &agrave; la (aux) soci&eacute;t&eacute; (s) m&egrave;re (s), aux entit&eacute;s du m&ecirc;me groupe et aux employ&eacute;s de DNAsbook General LLC, et attribue. Toutes les r&eacute;f&eacute;rences &agrave; &laquo;vous&raquo; et &laquo;votre&raquo; signifient et font r&eacute;f&eacute;rence &agrave; cet affili&eacute; &laquo;4&raquo; de l&#39;opportunit&eacute; qui a sign&eacute; le pr&eacute;sent accord en cliquant sur &laquo;J&#39;accepte&raquo;. L&#39;opportunit&eacute; &laquo;4&raquo; et vous &ecirc;tes chacun d&eacute;sign&eacute; dans le pr&eacute;sent contrat en tant que &laquo;partie&raquo;, et collectivement en tant que &laquo;parties&raquo;.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">2. ENTREPRENEUR IND&Eacute;PENDANT. Vous &ecirc;tes un entrepreneur ind&eacute;pendant de Opportunity &quot;4&quot;. C&rsquo;est la compr&eacute;hension et l&rsquo;intention explicites des Parties qu&rsquo;aucune relation de ma&icirc;tre &agrave; serviteur ou de mandant &agrave; mandataire ne doit exister entre Opportunity &quot;4&quot; et Vous en vertu du pr&eacute;sent Contrat d&rsquo;affiliation.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">3. DUR&Eacute;E ET R&Eacute;SILIATION. Votre contrat avec l&#39;opportunit&eacute; &quot;4&quot; commence lorsque vous cliquez sur &quot;J&#39;accepte&quot; et continue chaque mois jusqu&#39;&agrave; ce que:</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">A. La possibilit&eacute; &quot;4&quot; annule votre compte en raison d&#39;une violation des termes du pr&eacute;sent accord. Si le pr&eacute;sent contrat est annul&eacute; en raison de votre violation, vous perdez toutes les commissions et primes qui vous sont dues ou qui pourraient vous &ecirc;tre dues &agrave; l&#39;avenir.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">ou</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">B. L&#39;opportunit&eacute; &quot;4&quot; ou ses successeurs ou ayants droit, &agrave; sa seule et absolue discr&eacute;tion, annule votre contrat d&#39;affiliation. Dans le cas o&ugrave; l&#39;opportunit&eacute; &quot;4&quot; ou ses successeurs ou ayants droit annuleraient vos accords d&#39;affiliation, un avis &eacute;crit sera envoy&eacute; &agrave; l&#39;adresse de messagerie que vous avez fournie &agrave; l&#39;opportunit&eacute; &quot;4&quot; et associ&eacute;e &agrave; votre profil d&#39;affili&eacute;.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">4. INDEMNISATION.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">A. COMMISSIONS. Apr&egrave;s avoir cliqu&eacute; sur &laquo;J&#39;accepte&raquo; pour les termes de cet accord, vous recevrez une URL d&#39;affiliation unique, que vous utiliserez pour annoncer l&#39;opportunit&eacute; &quot;4&quot;. L&#39;opportunit&eacute; &laquo;4&raquo; offre 4 niveaux d&#39;avantages. Si un utilisateur s&#39;enregistre directement sur l&#39;URL de l&#39;affili&eacute;, cet abonn&eacute; sera plac&eacute; directement sur votre niveau 1. Les utilisateurs qui s&#39;abonnent sur votre abonn&eacute; de niveau 1 L&#39;URL de l&#39;affili&eacute; sera plac&eacute; sur votre niveau 2. Les utilisateurs qui s&#39;abonnent &agrave; votre URL de partenaire pour les abonn&eacute;s de niveau 2 seront plac&eacute;s sur votre niveau 3. Les utilisateurs qui s&#39;abonnent &agrave; votre URL de partenaire pour les abonn&eacute;s de niveau 3 seront plac&eacute;s sur votre niveau 4. Le niveau 4 correspond &agrave; la fin de vos avantages. Les utilisateurs qui s&rsquo;abonnent &agrave; votre URL d&rsquo;affiliation ne vous appartiennent pas, vous ne b&eacute;n&eacute;ficiez pas de leurs frais. Chaque mois, l&#39;opportunit&eacute; &laquo;4&raquo; vous rapporte 40% du total des frais collect&eacute;s &agrave; vos 4 niveaux, car il y a 4 niveaux, vous obtenez 10% de la commission de chaque abonn&eacute; &agrave; chacun des 4 niveaux. Les commissions vous seront vers&eacute;es en fonction du moyen de paiement que vous avez choisi, du pays dans lequel vous vivez et d&#39;autres conditions.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">B. BONUS. Nous avons des bonus pour les abonn&eacute;s. En savoir plus sur ces bonus ici! Regardez cette vid&eacute;o pour plus d&#39;explications!</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">C. TAXES. Avant que vous puissiez recevoir une commission ou des primes, vous devez fournir &agrave; l&rsquo;opportunit&eacute; &quot;4&quot; un W-8 ou un W-9 d&ucirc;ment rempli, comme indiqu&eacute; par l&rsquo;opportunit&eacute; &quot;4&quot;. Vous serez r&eacute;put&eacute; avoir renonc&eacute; de mani&egrave;re permanente &agrave; tous les droits sur les commissions ou les bonus gagn&eacute;s plus de 30 jours avant de soumettre un W-8 ou un W-9 &agrave; l&#39;opportunit&eacute; &quot;4&quot; d&ucirc;ment rempli. Vous &ecirc;tes responsable de tous les passifs d&#39;imp&ocirc;ts, y compris, sans limitation, les passifs d&#39;imp&ocirc;ts r&eacute;sultant de, ou li&eacute;s de quelque mani&egrave;re que ce soit, aux commissions ou aux bonus que Vous recevez de Opportunity &quot;4&quot;. Si vous n&#39;&ecirc;tes pas un r&eacute;sident des &Eacute;tats-Unis, Opportunity &quot;4&quot; peut retenir l&#39;imp&ocirc;t (y compris, sans limitation, la TVA) dans les cas o&ugrave; la loi en vigueur l&#39;exige. Lorsque l&#39;opportunit&eacute; &quot;4&quot; est requise pour retenir l&#39;imp&ocirc;t, l&#39;opportunit&eacute; &quot;4&quot; documentera cette retenue.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">D. COMMISSION MINIMUM ET PAIEMENT DE BONUS. Le montant de votre commission et de votre bonus combin&eacute;s doit &ecirc;tre &eacute;gal ou sup&eacute;rieur &agrave; 2000 FCFA (2000 FCFA) avant que vous ne receviez un paiement de la part de l&#39;opportunit&eacute; &quot;4&quot;. Si vos commissions et bonus combin&eacute;s pour un mois donn&eacute; sont inf&eacute;rieurs &agrave; 50,00 $, vos commissions et bonus seront conserv&eacute;s jusqu&#39;&agrave; ce que vos commissions et bonus combin&eacute;s soient &eacute;gaux ou sup&eacute;rieurs &agrave; 2000 FCFA.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">E. COMMISSION ET BONUS. Les commissions et les bonus ne sont pay&eacute;s que pour ceux re&ccedil;us par Opportunity &quot;4&quot;. Si les frais ne sont pas effectivement re&ccedil;us par l&#39;opportunit&eacute; &quot;4&quot;, vous ne recevrez pas de commission. Si des frais dans un compte entra&icirc;nent ult&eacute;rieurement un remboursement ou une facturation, et si une commission ou un bonus vous a &eacute;t&eacute; vers&eacute; au titre de ces frais, la commission ou le bonus sera alors d&eacute;duit de vos futures commissions. Si Opportunity &quot;4&quot; d&eacute;termine, &agrave; sa discr&eacute;tion raisonnable, que des frais ont &eacute;t&eacute; pay&eacute;s de mani&egrave;re frauduleuse ou &agrave; la suite d&#39;une violation du pr&eacute;sent Contrat, aucune commission ni aucun Bonus ne seront vers&eacute;s pour ces frais. Si des commissions ou des primes sont pay&eacute;es &agrave; partir d&rsquo;une commission produite frauduleusement ou &agrave; la suite de toute violation du pr&eacute;sent Contrat, et que la fraude ou la violation est d&eacute;couverte par Opportunity &quot;4&quot; apr&egrave;s le paiement, le montant de ce paiement sera d&eacute;duit de Vos futures commissions et bonus et le compte supprim&eacute;.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">F. DOLLARS US. Toutes les commissions sont pay&eacute;es en dollars am&eacute;ricains via PayPal ou par ch&egrave;que.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">5. COMMERCIALISATION ET RECRUTEMENT.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">A. V&Eacute;RITABLE Tout ce que vous communiquez dans le marketing ou la publicit&eacute; d&#39;un service ou d&#39;une opportunit&eacute; de Opportunit&eacute; &quot;4&quot; doit &ecirc;tre vrai et pr&eacute;cis. Les r&eacute;clamations relatives &agrave; un service ou une opportunit&eacute; non conforme ou frauduleuse de Opportunity &quot;4&quot; sont strictement interdites. Vous ne pouvez pas pr&eacute;tendre qu&#39;un gouvernement, une personne ou une entit&eacute; ait approuv&eacute; ou soutenu l&#39;opportunit&eacute; &quot;4&quot;. Vous ne pouvez pas utiliser la propri&eacute;t&eacute; intellectuelle d&#39;une autre personne ou entit&eacute; pour annoncer un service ou une opportunit&eacute; de Opportunit&eacute; &quot;4&quot;.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">B. AVERTISSEMENT. Sur tout site Web sur lequel vous publiez un service ou une opportunit&eacute; Opportunity &laquo;4&raquo;, vous devez clairement afficher (c&#39;est-&agrave;-dire pas dans un lien ou dans une petite police) le langage de non-responsabilit&eacute; suivant:</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">Divulgation: Je suis une opportunit&eacute; ind&eacute;pendante &quot;4&quot; affili&eacute;e, pas un employ&eacute;. Je re&ccedil;ois des paiements de recommandation de l&#39;opportunit&eacute; &quot;4&quot;. Les opinions exprim&eacute;es ici sont les miennes et ne constituent pas des d&eacute;clarations officielles d&rsquo;Opportunity &quot;4&quot; ou de sa soci&eacute;t&eacute; m&egrave;re, DNAsbook General, LLC.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">C. NON-DISPARAGEMENT. Vous n&#39;&ecirc;tes pas autoris&eacute; &agrave; d&eacute;nigrer les produits de services de toute autre personne ou entit&eacute;, y compris, sans limitation, les produits ou services d&#39;un concurrent d&#39;Opportunity &quot;4&quot;.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">D. CHARGEMENT DE L&rsquo;INVENTAIRE / RABAIS. Aucune commission ni prime ne vous sera vers&eacute;e pour les paiements effectu&eacute;s sur votre (vos) compte (s) d&#39;utilisateur. Vous n&#39;&ecirc;tes pas autoris&eacute; &agrave; ouvrir un compte d&#39;opportunit&eacute; &quot;4&quot; sous le nom d&#39;une autre personne ou entit&eacute;, ou sous un nom fictif. Vous n&#39;&ecirc;tes pas autoris&eacute; &agrave; ouvrir un compte Opportunity &quot;4&quot; sous un nom quelconque dans le seul but d&#39;obtenir des commissions, des bonus ou toute autre compensation, y compris, sans limitation, des incitations ou des prix pouvant &ecirc;tre offerts de temps &agrave; autre. La violation de ce paragraphe constituera une violation substantielle du pr&eacute;sent Accord, et vous acceptez de rembourser &agrave; Opportunity &quot;4&quot; toutes les Commissions et Bonus gagn&eacute;s &agrave; la suite d&#39;une telle violation.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">E. REVENDICATIONS DE REVENU. Si vos efforts de recrutement incluent des revendications li&eacute;es au revenu potentiel qu&#39;une opportunit&eacute; &quot;4&quot; peut faire, ou si vous faites r&eacute;f&eacute;rence &agrave; un revenu que vous avez g&eacute;n&eacute;r&eacute;, ou si vous faites r&eacute;f&eacute;rence &agrave; des opportunit&eacute;s de style de vie que vous avez en raison de cette opportunit&eacute; &quot;4&quot;, Les directives suivantes doivent &ecirc;tre respect&eacute;es:</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">1. Vos d&eacute;clarations doivent &ecirc;tre compl&egrave;tement vraies et exactes et s&#39;appuyer sur des preuves;</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">2. Si vous utilisez un sc&eacute;nario hypoth&eacute;tique, vous devez clairement le qualifier de sc&eacute;nario hypoth&eacute;tique; et</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">3. Vos relev&eacute;s doivent &ecirc;tre accompagn&eacute;s de la d&eacute;claration de revenus relative &agrave; Opportunity &quot;4&quot;.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">6. Occasion &quot;4&quot; &rsquo;PROPRI&Eacute;T&Eacute; INTELLECTUELLE. Aucun logo, slogan, marque commerciale, nom commercial, &eacute;l&eacute;ment prot&eacute;g&eacute; par le droit d&#39;auteur, brevet, habillage commercial, secret commercial ou information confidentielle (collectivement d&eacute;nomm&eacute;e &ldquo;Opportunity&quot; 4 &quot;Propri&eacute;t&eacute; intellectuelle&quot;) appartenant &agrave; Opportunity &quot;4&quot; ne peut &ecirc;tre utilis&eacute;, copi&eacute; ou reproduit par vous, sauf indication contraire ci-dessous. Aucune opportunit&eacute; &quot;4&quot; La propri&eacute;t&eacute; intellectuelle (ou toute marque ressemblant de mani&egrave;re confuse &agrave; une opportunit&eacute; &quot;4&quot; Propri&eacute;t&eacute; intellectuelle) ne doit en aucun cas &ecirc;tre mise en vente ou enregistr&eacute;e en tant que nom de domaine.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">Vous pouvez utiliser la marque d&#39;opportunit&eacute; &quot;4&quot; TM pour annoncer l&#39;opportunit&eacute; &quot;4&quot;. Chaque fois que vous utilisez la marque Opportunity &quot;4&quot; TM, vous devez le faire d&#39;une mani&egrave;re qui ne risque pas de d&eacute;router les lecteurs ou de les amener &agrave; penser que vous parlez pour l&#39;opportunit&eacute; &quot;4&quot;. Si votre utilisation de Opportunity &quot;4&quot; TM est source de confusion, elle sera d&eacute;termin&eacute;e par Opportunity &quot;4&quot; dans Opportunity &quot;4&quot; &#39;&agrave; la seule et absolue discr&eacute;tion. Les directives suivantes, qui peuvent &ecirc;tre modifi&eacute;es ou compl&eacute;t&eacute;es &agrave; tout moment, sont con&ccedil;ues pour &eacute;viter toute confusion du lecteur:</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- Vous ne devez pas utiliser la &laquo;voix&raquo; de, ni pr&eacute;tendre parler en son nom, l&#39;opportunit&eacute; &laquo;4&raquo;.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- Chaque fois que vous utilisez le mot &laquo;Opportunit&eacute;&quot; 4 &quot;&raquo;, il doit &ecirc;tre imm&eacute;diatement suivi des lettres &quot;TM&quot; en majuscules.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- Lorsqu&#39;il est utilis&eacute; en prose, Opportunity &quot;4&quot; TM doit &ecirc;tre utilis&eacute; dans la m&ecirc;me police que le reste de la prose.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- Lorsqu&rsquo;il est utilis&eacute; &agrave; des fins autres que la prose, Opportunity &quot;4&quot; TM doit &ecirc;tre utilis&eacute; dans la police de caract&egrave;res utilis&eacute;e par le logo de Opportunity &quot;4&quot; &rsquo;dans le logo de l&rsquo;entreprise Opportunity&quot; 4 &quot;.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- Sur tout site Web ou plate-forme de m&eacute;dia social sur lequel vous utilisez le mot Opportunity &quot;4&quot; TM, vous devez inclure la divulgation identifi&eacute;e au paragraphe 5 (D) ci-dessus.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">- Vous ne pouvez utiliser que d&#39;autres images, photographies et marques commerciales autoris&eacute;es express&eacute;ment 