General, LLC</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">160 avenue Grumman, n &deg; 207</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">Newark, NJ 07112</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">yahiadjipe@yahoo.com</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">L&#39;opportunit&eacute; &quot;4&quot; vous enverra des notifications &agrave; l&#39;adresse de messagerie que vous avez fournie &agrave; l&#39;opportunit&eacute; &quot;4&quot;. Tout avis sera r&eacute;put&eacute; avoir &eacute;t&eacute; remis &agrave; vous lorsqu&#39;il aura &eacute;t&eacute; envoy&eacute; par Opportunit&eacute; &quot;4&quot;. Vous &ecirc;tes seul responsable de la r&eacute;solution des probl&egrave;mes techniques li&eacute;s &agrave; votre adresse de messagerie ou &agrave; votre serveur, ainsi que de la lecture de tout courrier &eacute;lectronique qui vous est envoy&eacute;.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">19. S&Eacute;ANCE. Si une disposition de la pr&eacute;sente convention est incompatible ou contraire &agrave; une loi, r&egrave;gle ou r&eacute;glementation applicable, elle est r&eacute;put&eacute;e avoir &eacute;t&eacute; modifi&eacute;e dans la mesure n&eacute;cessaire pour se conformer &agrave; la loi, &agrave; la r&egrave;gle ou &agrave; la r&eacute;glementation, et les Termes et Conditions, ainsi modifi&eacute;s, resteront pleinement en vigueur.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">&nbsp;</p>', NULL, NULL, 'PAGE', 'NO SIDEBAR', '2018-12-12 21:19:13', '2018-12-14 23:43:37', 'fr'),
(14, 'PUBLISHED', NULL, 'Privacy policy', 'privacy-policy', '<p><strong>I. Personally-Identifiable Information and Non-Personally Identifiable Information.</strong></p>\r\n\r\n<p>DNAsbook General, LLC (also referred to herein as &ldquo;OPPORTUNITY &quot;4&quot;&rdquo;) may collect two different types of information, Personally Identifiable Information (&ldquo;PII&rdquo;) and Non-Personally Identifiable Information (&ldquo;Non-PII&rdquo;). PII that we collect is information that identifies you as an individual &ndash; and includes your name, address, telephone number, e-mail address, credit card information, billing address and shipping information. Non-PII is aggregated information, demographic information, IP addresses, user behavior data from web interaction metrics tools and other information that does not reveal your specific identity. PII and Non-PII may be collected anytime you access or use a OPPORTUNITY &quot;4&quot; website. PII and Non-PII may also be collected by OPPORTUNITY &quot;4&quot; during in-person discussions, telephone conversations, and electronic or other written communications. OPPORTUNITY &quot;4&quot; also collects information via cookies; blocking cookies may render you unable to access certain OPPORTUNITY &quot;4&quot; products, services, or websites.</p>\r\n\r\n<p>OPPORTUNITY &quot;4&quot; uses PII to respond to your inquiries, provide you with services you have requested, keep you informed of services OPPORTUNITY &quot;4&quot; thinks may be of interest to you, and otherwise personalize your experience with OPPORTUNITY &quot;4&quot;, and other reasons. OPPORTUNITY &quot;4&quot; does not sell or lease PII about you to others, and may in some cases be liable for so doing under the Privacy Shield Framework outlined below. OPPORTUNITY &quot;4&quot; will provide your e-mail address to affiliates or users who refer you to us, or through whom you create a OPPORTUNITY &quot;4&quot; account. OPPORTUNITY &quot;4&quot; shares your PII with OPPORTUNITY &quot;4&quot; affiliates and third parties contracting with OPPORTUNITY &quot;4&quot; to provide services to you, including financial institutions, API integrators you have chosen, and other third party software services that you have chosen to assist you with your sales funnels. OPPORTUNITY &quot;4&quot; employees who design our databases and software, and those employees who provide you with customer service, along with our customer service software partners, also have access to PII as part of their job in providing services to You. OPPORTUNITY &quot;4&quot; may also share PII when required by law, or when you have expressly requested OPPORTUNITY &quot;4&quot; to do so. OPPORTUNITY &quot;4&quot; reserves the right to disclose and use your PII if OPPORTUNITY &quot;4&quot; believes it is necessary to: (a) respond to legal process, e.g., a subpoena; (b) respond to a law enforcement agency&rsquo;s request; (c) enforce the Terms; or (d) protect the rights, privacy, safety, property, or operations of OPPORTUNITY &quot;4&quot; or third parties;</p>\r\n\r\n<p>Because Non-PII does not personally identify You, OPPORTUNITY &quot;4&quot; reserves the right to use and disclose to third parties Non-PII for any purpose.</p>\r\n\r\n<p>OPPORTUNITY &quot;4&quot; maintains reasonable physical, administrative and technical safeguards to protect PII from loss, misuse, or unauthorized access, disclosure, alteration or destruction. OPPORTUNITY &quot;4&quot; enforces its Privacy Policy via self-assessment.</p>\r\n\r\n<p>OPPORTUNITY &quot;4&quot; reserves the right to change this privacy notice, which changes will become effective upon posting of the revised notice on&nbsp;&nbsp;<a href=\"https://www.clickfunnels.com/privacy\">https://www.dnasbookdigimarketafrica.com/pages/privacy-policy</a>, or upon emailing of the changes to You at the email address You provided to OPPORTUNITY &quot;4&quot;, or as required by law.</p>\r\n\r\n<p><strong>II. Links to or From Other Sites.</strong></p>\r\n\r\n<p>Except where expressly stated by OPPORTUNITY &quot;4&quot;, OPPORTUNITY &quot;4&quot; is not affiliated or associated with operators of any third party websites that link to or are linked from any OPPORTUNITY &quot;4&quot;-maintained website. OPPORTUNITY &quot;4&quot; disclaims any responsibility for the accuracy or content of information found on third party websites that link to or are linked from any OPPORTUNITY &quot;4&quot; website. OPPORTUNITY &quot;4&quot; disclaims any responsibility for the security of any information (including without limitation credit card and personally identifiable information (&ldquo;PII&rdquo;)) that you may provide to any third party. OPPORTUNITY &quot;4&quot; reserves the right, at any time and in its sole and absolute discretion, to block links to any OPPORTUNITY &quot;4&quot;-maintained website through technological or other means without prior notice.</p>\r\n\r\n<p><strong>III. Information; Registration; User Names and Passwords</strong></p>\r\n\r\n<p>As a OPPORTUNITY &quot;4&quot; website user, you will be required to create an account with OPPORTUNITY &quot;4&quot;. You warrant that the information you provide OPPORTUNITY &quot;4&quot; is truthful and accurate, and that you are not impersonating another person. You are responsible for maintaining the confidentiality of any password you may use to access your OPPORTUNITY &quot;4&quot; account, and you agree not to transfer your password or User name, or lend or otherwise transfer your use of or access to your account, to any third party. You are fully responsible for all transactions with, and information conveyed to, OPPORTUNITY &quot;4&quot; under your account. You agree to immediately notify OPPORTUNITY &quot;4&quot; of any unauthorized use of your password or User name or any other breach of security related to your account. You agree that OPPORTUNITY &quot;4&quot; is not liable, and you will hold OPPORTUNITY &quot;4&quot; harmless, for any loss or damage arising from your failure to comply with any of the foregoing obligations.</p>\r\n\r\n<p><strong>IV. EU-US and Swiss-US Privacy Shield Frameworks.</strong></p>\r\n\r\n<p>OPPORTUNITY &quot;4&quot; complies with the EU-US Privacy Shield Framework and the Swiss-US Privacy Shield Framework as set forth by the US Department of Commerce regarding the collection, use, and retention of personal information transferred from European Union and Switzerland to the United States, respectively. OPPORTUNITY &quot;4&quot; has certified to the Department of Commerce that it adheres to the Privacy Shield Principles. If there is any conflict between the policies in this privacy policy and the Privacy Shield Principles, the Privacy Shield Principles shall govern. To learn more about the Privacy Shield program, and to view our certification page, please visit <a href=\"http://www.privacyshield.gov/\" style=\"text-decoration-line:none\">www.privacyshield.gov</a>. For full definitions of the Privacy Shield Principles, please visit <a href=\"http://www.privacyshield.gov/EU-US-Framework.\" style=\"text-decoration-line:none\">www.privacyshield.gov/EU-US-Framework</a>.</p>\r\n\r\n<p>Under the Privacy Shield, you have the right to access, correct, or delete your personal data. You also have the right to limit OPPORTUNITY &quot;4&quot;&rsquo; use of your data &ndash; including the right to opt-in or out of receiving communications from OPPORTUNITY &quot;4&quot;. To exercise any of these rights, please send an email to yahiadjipe@yahoo.com.</p>\r\n\r\n<p><strong>Third party data transfer.</strong> OPPORTUNITY &quot;4&quot; may be liable for the transfer of EU and/or Swiss personal data to third parties acting as our agents unless we can prove we are not responsible for the event given rise to the damages.</p>\r\n\r\n<p><strong>The Choice Principle.</strong> Note that we may be required to release personal data of EU and/or Swiss individuals in response to lawful requests by public authorities including to meet national security and law enforcement requirements.</p>\r\n\r\n<p>In compliance with the EU-US and Swiss-US Privacy Shield Principles, OPPORTUNITY &quot;4&quot; commits to resolve complaints about your privacy and our collection or use of your personal information. European Union or Swiss individuals with inquiries or complaints regarding this privacy policy should contact OPPORTUNITY &quot;4&quot; at:</p>\r\n\r\n<p>Email: yahiadjipe@yahoo.com</p>\r\n\r\n<p>Regular Mail: OPPORTUNITY &quot;4&quot;, Attn: 160 Grumman Ave, #207 NEWARK NJ 07112</p>\r\n\r\n<p>OPPORTUNITY &quot;4&quot; has further committed to refer unresolved privacy complaints under the Privacy Shield Principles to an independent dispute resolution mechanism, the BBB EU PRIVACY SHIELD, a non-profit alternative dispute resolution provider located in the United States and operated by the Council of Better Business Bureaus. If you do not receive timely acknowledgement of your complaint, or if your complaint is not satisfactorily addressed, please visit <a href=\"https://app.clickfunnels.com/pages/8570218/%E2%80%8Bwww.bbb.org/EU-privacy-shield/for-eu-consumers\" style=\"text-decoration-line:none\">www.bbb.org/EU-privacy-shield/for-eu-consumers</a> for more information and to file a complaint. Under certain limited conditions, individuals in the European Union or Switzerland may have the right to invoke &ldquo;last resort&rdquo; binding arbitration before the Privacy Shield Panel to be created by the U.S. Department of Commerce and the European Commission. The Federal Trade Commission has jurisdiction with enforcement authority over OPPORTUNITY &quot;4&quot;&rsquo; compliance with the Privacy Shield.</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, 'PAGE', 'NO SIDEBAR', '2018-12-12 21:20:02', '2018-12-15 00:13:20', 'en');
