(15, 'PUBLISHED', NULL, 'Privacy policy', 'privacy-policy', '<p>I. Informations personnellement identifiables et non personnellement identifiables.</p>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>DNAsbook General, LLC (&eacute;galement d&eacute;sign&eacute;e dans le pr&eacute;sent document &laquo;OPPORTUNITY&quot; 4 &quot;) peut collecter deux types d&#39;informations diff&eacute;rentes, les informations personnellement identifiables (&quot; PII &quot;) et les informations non personnellement identifiables (&quot; non-PII &quot;). Les informations personnelles que nous collectons sont des informations qui vous identifient en tant qu&#39;individu - et comprennent votre nom, votre adresse, votre num&eacute;ro de t&eacute;l&eacute;phone, votre adresse de courrier &eacute;lectronique, les informations de carte de cr&eacute;dit, l&#39;adresse de facturation et les informations d&#39;exp&eacute;dition. Les informations non-PII sont des informations agr&eacute;g&eacute;es, des informations d&eacute;mographiques, des adresses IP, des donn&eacute;es sur le comportement des utilisateurs &agrave; partir d&#39;outils de m&eacute;triques d&#39;interaction Web et d&#39;autres informations qui ne r&eacute;v&egrave;lent pas votre identit&eacute; sp&eacute;cifique. Les donn&eacute;es personnelles et non personnelles peuvent &ecirc;tre collect&eacute;es chaque fois que vous acc&eacute;dez ou utilisez un site Web OPPORTUNITY &quot;4&quot;. Les informations personnelles et non personnelles peuvent &eacute;galement &ecirc;tre collect&eacute;es par OPPORTUNITY &quot;4&quot; lors de discussions en personne, de conversations t&eacute;l&eacute;phoniques et de communications &eacute;lectroniques ou autres communications &eacute;crites. OPPORTUNITY &quot;4&quot; collecte &eacute;galement des informations via des cookies; Le blocage des cookies peut vous emp&ecirc;cher d&#39;acc&eacute;der &agrave; certains produits, services ou sites Web OPPORTUNITY &quot;4&quot;.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>OPPORTUNITY &quot;4&quot; utilise les informations personnelles pour r&eacute;pondre &agrave; vos questions, vous fournir les services que vous avez demand&eacute;s, vous tenir inform&eacute; de ses services. OPPORTUNITY &quot;4&quot; peut vous int&eacute;resser et personnaliser votre exp&eacute;rience avec OPPORTUNITY &quot;4&quot;, etc. les raisons. OPPORTUNITY &quot;4&quot; ne vend pas ou ne loue pas les informations personnelles vous concernant &agrave; d&#39;autres personnes et peut, dans certains cas, &ecirc;tre tenu responsable en vertu du cadre relatif au bouclier de protection des donn&eacute;es personnel d&eacute;crit ci-dessous. OPPORTUNITY &quot;4&quot; fournira votre adresse &eacute;lectronique aux soci&eacute;t&eacute;s affili&eacute;es ou aux utilisateurs qui vous ont r&eacute;f&eacute;r&eacute; &agrave; nous ou par l&#39;interm&eacute;diaire desquels vous avez cr&eacute;&eacute; un compte OPPORTUNITY &quot;4&quot;. OPPORTUNITY &quot;4&quot; partage vos donn&eacute;es personnelles avec OPPORTUNITY &quot;4&quot; soci&eacute;t&eacute;s affili&eacute;es et des tiers contractant avec OPPORTUNITY &quot;4&quot; pour vous fournir des services, notamment des institutions financi&egrave;res, des int&eacute;grateurs d&#39;API que vous avez choisis et des services de logiciels tiers que vous avez choisis d&#39;assister. vous avec vos entonnoirs de vente. OPPORTUNIT&Eacute; Les &laquo;4&raquo; employ&eacute;s qui con&ccedil;oivent nos bases de donn&eacute;es et nos logiciels, ainsi que les employ&eacute;s qui vous fournissent un service client, ainsi que nos partenaires du logiciel client, ont &eacute;galement acc&egrave;s aux informations personnelles dans le cadre de leur travail consistant &agrave; vous fournir des services. OPPORTUNITY &quot;4&quot; peut &eacute;galement partager vos informations personnelles lorsque cela est requis par la loi ou lorsque vous avez express&eacute;ment demand&eacute; &agrave; OPPORTUNITY &quot;4&quot; de le faire. OPPORTUNITY &quot;4&quot; se r&eacute;serve le droit de divulguer et d&#39;utiliser vos donn&eacute;es personnelles si OPPORTUNITY &quot;4&quot; juge n&eacute;cessaire de: (a) r&eacute;pondre &agrave; une proc&eacute;dure l&eacute;gale, par exemple une assignation &agrave; compara&icirc;tre; b) r&eacute;pondre &agrave; la demande d&rsquo;un organisme charg&eacute; de l&rsquo;application de la loi; (c) appliquer les conditions; ou (d) prot&eacute;ger les droits, la vie priv&eacute;e, la s&eacute;curit&eacute;, la propri&eacute;t&eacute; ou les op&eacute;rations de OPPORTUNITY &quot;4&quot; ou de tiers;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>\r\n<div>Parce que Non-PII ne vous identifie pas personnellement, OPPORTUNITY &quot;4&quot; se r&eacute;serve le droit d&#39;utiliser et de divulguer &agrave; des tiers des Non-PII &agrave; quelque fin que ce soit.</div>\r\n\r\n<div>OPPORTUNITY &quot;4&quot; maintient des sauvegardes physiques, administratives et techniques raisonnables pour prot&eacute;ger les donn&eacute;es personnelles contre toute perte, utilisation abusive ou tout acc&egrave;s non autoris&eacute;, divulgation, alt&eacute;ration ou destruction. OPPORTUNITY &quot;4&quot; applique sa politique de confidentialit&eacute; via une auto-&eacute;valuation.</div>\r\n\r\n<div>OPPORTUNITY &quot;4&quot; se r&eacute;serve le droit de modifier la pr&eacute;sente d&eacute;claration de confidentialit&eacute;. Cette modification entrera en vigueur lors de la publication de la nouvelle version sur&nbsp;&nbsp;<a href=\"https://www.clickfunnels.com/privacy\">https://www.dnasbookdigimarketafrica.com/pages/privacy-policy</a>, ou apr&egrave;s son envoi par courrier &eacute;lectronique &agrave; l&#39;adresse e-mail indiqu&eacute;e fourni &agrave; OPPORTUNITY &quot;4&quot;, ou tel que requis par la loi.</div>\r\n</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>II. Liens vers ou &agrave; partir d&#39;autres sites.</div>\r\n\r\n<div>Sauf mention contraire expresse dans OPPORTUNITY &quot;4&quot;, OPPORTUNITY &quot;4&quot; n&#39;est ni affili&eacute; ni associ&eacute; &agrave; des exploitants de sites Web tiers li&eacute;s &agrave; ou li&eacute;s &agrave; tout site Web maintenu par OPPORTUNITY &quot;4&quot;. OPPORTUNITY &quot;4&quot; d&eacute;cline toute responsabilit&eacute; quant &agrave; l&#39;exactitude ou au contenu des informations trouv&eacute;es sur les sites Web de tiers pointant vers ou li&eacute;es &agrave; tout site Web d&#39;OPPORTUNITY &quot;4&quot;. OPPORTUNITY &quot;4&quot; d&eacute;cline toute responsabilit&eacute; quant &agrave; la s&eacute;curit&eacute; des informations (y compris, sans limitation, les informations relatives aux cartes de cr&eacute;dit et aux informations personnelles identifiables (&laquo;PII&raquo;)) que vous pourriez fournir &agrave; des tiers. OPPORTUNITY &quot;4&quot; se r&eacute;serve le droit, &agrave; tout moment et &agrave; sa seule et absolue discr&eacute;tion, de bloquer les liens vers tout site Web maintenu par OPPORTUNITY &quot;4&quot; par un moyen technologique ou autre, sans pr&eacute;avis.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>III. Information; Enregistrement; Noms d&#39;utilisateur et mots de passe</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>En tant qu&#39;utilisateur du site Web OPPORTUNITY &quot;4&quot;, il vous sera demand&eacute; de cr&eacute;er un compte avec OPPORTUNITY &quot;4&quot;. Vous garantissez que les informations que vous fournissez &agrave; OPPORTUNITY &quot;4&quot; sont v&eacute;ridiques et exactes, et que vous ne vous faites pas passer pour une autre personne. Vous &ecirc;tes responsable du maintien de la confidentialit&eacute; de tout mot de passe que vous pouvez utiliser pour acc&eacute;der &agrave; votre compte OPPORTUNITY &quot;4&quot;, et vous acceptez de ne pas transf&eacute;rer votre mot de passe ou votre nom d&#39;utilisateur, ni de vous pr&ecirc;ter ou de transf&eacute;rer de toute autre mani&egrave;re votre utilisation de votre compte ou l&#39;acc&egrave;s &agrave; votre compte &agrave; tout compte. tierce personne. Vous &ecirc;tes enti&egrave;rement responsable de toutes les transactions et des informations transmises &agrave; OPPORTUNITY &quot;4&quot; sur votre compte. Vous acceptez d&#39;avertir imm&eacute;diatement OPPORTUNITY &quot;4&quot; de toute utilisation non autoris&eacute;e de votre mot de passe ou nom d&#39;utilisateur ou de toute autre violation de la s&eacute;curit&eacute; li&eacute;e &agrave; votre compte. Vous convenez qu&#39;OPPORTUNITY &quot;4&quot; n&#39;est pas responsable et vous garderez OPPORTUNITY &quot;4&quot; de tout dommage ou perte r&eacute;sultant de votre non-respect de l&#39;une des obligations susmentionn&eacute;es.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>IV Bouclier de protection de la vie priv&eacute;e UE-&Eacute;tats-Unis et Suisse-&Eacute;tats-Unis.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>\r\n<div>OPPORTUNITY &quot;4&quot; est conforme au Privacy Shield Framework UE-&Eacute;tats-Unis et au Privacy Shield Framework &eacute;tablis par le D&eacute;partement du commerce des &Eacute;tats-Unis en ce qui concerne la collecte, l&#39;utilisation et la conservation des informations personnelles transf&eacute;r&eacute;es de l&#39;Union europ&eacute;enne et de la Suisse aux &Eacute;tats-Unis. &Eacute;tats, respectivement. OPPORTUNITY &quot;4&quot; a certifi&eacute; aupr&egrave;s du minist&egrave;re du Commerce qu&#39;il adh&egrave;re aux principes de protection de la vie priv&eacute;e. En cas de conflit entre les r&egrave;gles de la pr&eacute;sente politique de confidentialit&eacute; et les principes du bouclier de protection des donn&eacute;es, ceux-ci pr&eacute;valent. Pour en savoir plus sur le programme Privacy Shield et pour consulter notre page de certification, veuillez visiter www.privacyshield.gov. Pour une d&eacute;finition compl&egrave;te des principes du bouclier de protection des donn&eacute;es, visitez le site www.privacyshield.gov/EU-US-Framework.</div>\r\n\r\n<div>Sous le bouclier de confidentialit&eacute;, vous avez le droit d&#39;acc&eacute;der &agrave; vos donn&eacute;es personnelles, de les corriger ou de les supprimer. Vous avez &eacute;galement le droit de limiter l&rsquo;utilisation de vos donn&eacute;es par OPPORTUNITY &quot;4&quot; - y compris le droit de choisir de ne pas recevoir les communications de OPPORTUNITY &quot;4&quot;. Pour exercer l&#39;un de ces droits, veuillez envoyer un courrier &eacute;lectronique &agrave; yahiadjipe@yahoo.com.</div>\r\n</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Transfert de donn&eacute;es tiers. OPPORTUNITY &quot;4&quot; peut &ecirc;tre tenu responsable du transfert de donn&eacute;es &agrave; caract&egrave;re personnel europ&eacute;ennes et / ou suisses &agrave; des tiers agissant en tant que nos agents, sauf si nous pouvons prouver que nous ne sommes pas responsables de l&#39;&eacute;v&eacute;nement qui a donn&eacute; lieu aux dommages.</div>', NULL, NULL, 'PAGE', 'NO SIDEBAR', '2018-12-12 21:20:25', '2018-12-15 00:12:42', 'fr'),
(16, 'PUBLISHED', NULL, '1A Why Opportunity 4', '1a-why-opportunity-4', '<p>Where the idea of Opportunity &ldquo;4&rdquo; came from?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>One day, in my teenage years, I was listening to one of our African presidents, he was giving a speech on how Africans can help each other.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>He wanted to know how we are going to help a brother who survives on fishes! What do we think is the best way to help him?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Answering to himself he said, the best way to do this is not bringing fishes to the brother everyday (this is what we do). It is &ldquo;bringing that brother to the fishes.&rdquo; What that means?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>He explained: Bringing fishes to the brother everyday will not help him that much, that will not be the best way to help him, that will transform him into a begger, someone who will be living on other people help, dependant on other people help, a parasite. Rather he said the best way to help that brother is to &ldquo;bring him to the fishes&rdquo;, this means to teach him how to fish. He said that will be the best gift we would have ever given to that brother who feeds on fishes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Why? That brother will have his self esteem back, he will be independant, he will teach how to fish to his family, friends, neighbors, everyone who feeds on fishes or eats fishes. Those he helps will help other people and the chain continues&hellip;. We will transform that brother from a begger to a helper&hellip;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As a teenager, when I heard this, it was the best thing I have ever heard, I was hangry learning!... This has transformed my life and point of view on how to help other people: is to help them to become independent.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>How this understanding becomes today the &ldquo;father&rdquo; of Opportunity &ldquo;4&rdquo;?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Let&rsquo;s me tell you!......</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Later in my life, I noticed that our government cannot provide jobs to everyone despite their efforts! Our expectations became short when we finished school. I was angered by the growing unemployment I witnessed!.... One thing is the government cannot employ all citizens in a country, the second thing is we cannot employ ourselves due to lack of means, the private sector is not developed!.....</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Is there any solution to this? Who knows it? Can somebody share the secret?....</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As a tennager, I was perplexe too! I was frustrated but unable to do anything!......</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Later, I came to America. Something struck me when I landed in America, the striking wealth compared to my country!... I immediately began thinking what makes America rich, the 1st economical power in the world!.... I found lot of things but one thing catches my attention, do you know what is it? That thing is what we are lacking in Africa, that thing is entrepreneurship! I am convinced that if we can learn to be entrepreneurs in Africa, we can resolve our financial problems!... Why? Because we are going to learn how to survive on ourselves, not depending on government help or jobs. Then I began thinking about how I can transfer western entrepreneurship into Africa, the cost being the main problem?.... This is how I came to put together Opportunity &ldquo;4&rdquo;!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Opportunity &ldquo;4&rdquo; is the western entrepreneurship africanized to the point that Africans don&rsquo;t even have to pay to participate into it! It is made free to them! I know we don&rsquo;t have means in Africa it is why I make it this way!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This knowledge of not having means in Africa leads to another inevitable question: what good that will be to teach Africans entrepreneurship for free if they cannot exercise it due to lack of means? Another giant problem to resolve!... Who has a suggestion!... Do you have one?.... What?....</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I do have one! I invented a rule that I call &ldquo;Rule 20/20&rdquo;. This rule along with a 40% commission I put in place helps pulverize this apparently huge problem!.... This puts in place a system that trains Africans into entrepreneurs for free after putting huge commissions in their pockets.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Opportunity &ldquo;4&rdquo; puts huge commissions into Africans pockets after training them into entrepreneurs giving them the means to practice what they will learn in Opportunity &ldquo;4&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Problems solved!... Up to Africans to show what they got!....</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The goal is to develop the private sector in Africa freeing them from the idea that government has all the solutions!... Governments are there for public services, we do need those public services they provide it is why we have to respect those in power, at the same time we need to survive, by doing what? By developing the private sector, where comes in handy Opportunity &ldquo;4&rdquo;!...</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>We know we have a lot of talents and brains in Africa, here is the mean to develop them: OPPORTUNITY &ldquo;4&rdquo;!...</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Register today and experience by yourself this revolution!</p>\r\n\r\n<div>&nbsp;</div>', NULL, NULL, 'PAGE', 'NO SIDEBAR', '2018-12-24 05:46:11', '2018-12-24 05:46:11', 'en'),
(17, 'PUBLISHED', NULL, '1A Pourquoi Opportunite 4', '1a-pourquoi-opportunite-4', '<p>D&#39;o&ugrave; m&rsquo;est venue l&#39;id&eacute;e de l&#39;Opportunit&eacute; &laquo;4&raquo;?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Un jour, dans mon adolescence, j&#39;&eacute;coutais l&#39;un de nos pr&eacute;sidents Africains, il pronon&ccedil;ait un discours sur la fa&ccedil;on dont les Africains peuvent s&#39;entraider.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Il voulait savoir comment nous allons aider un fr&egrave;re qui survit sur du poisson! Selon vous, quelle est la meilleure fa&ccedil;on de l&#39;aider?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>R&eacute;pondant &agrave; lui-m&ecirc;me, il a dit que la meilleure fa&ccedil;on de le faire est de ne pas apporter de poissons au fr&egrave;re chaque jour (c&#39;est ce que nous faisons), plut&ocirc;t il faut &ldquo;amener ce fr&egrave;re aux poissons&rdquo;. Qu&#39;est-ce que cela signifie?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Il a expliqu&eacute;: apporter chaque jour des poissons &agrave; ce fr&egrave;re ne l&#39;aidera pas beaucoup, ce ne sera pas la meilleure fa&ccedil;on de l&#39;aider, cela le transformera en mendiant, quelqu&#39;un qui vivra au d&eacute;pend des autres, d&eacute;pendant de l&#39;aide des autres, un parasite! Au contraire, il a dit que le meilleur moyen d&#39;aider ce fr&egrave;re est de &quot;l&#39;amener aux poissons&quot;, cela signifie lui apprendre &agrave; p&ecirc;cher lui-m&ecirc;me. Ce serait le meilleur cadeau que nous aurions jamais offert &agrave; ce fr&egrave;re qui se nourrit de poissons, a-t-il dit!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pourquoi? Ce fr&egrave;re retrouvera son estime de soi, il sera ind&eacute;pendant, il apprendra comment p&ecirc;cher &agrave; sa famille, &agrave; ses amis, &agrave; ses voisins, &agrave; tous ceux qui se nourrissent de poissons comme lui ou en mangent. Ceux qu&rsquo;il aide aideront d&rsquo;autres personnes et la cha&icirc;ne continue&hellip;. Nous allons transformer ce fr&egrave;re de mendiant en assistant, en donneur&hellip;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>En tant qu&#39;adolescent, quand j&#39;ai entendu cela, c&#39;&eacute;tait la meilleure chose que j&#39;ai jamais entendue, &eacute;tant avide &agrave; apprendre! ... Cela a transform&eacute; ma vie et mon point de vue sur la fa&ccedil;on d&#39;aider les autres: c&#39;est de les aider &agrave; devenir ind&eacute;pendants.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Comment cette compr&eacute;hension devient-elle aujourd&#39;hui le &laquo;p&egrave;re&raquo; de l&#39;opportunit&eacute; &laquo;4&raquo;?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Laissez-moi vous le dire! ......</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Plus tard dans ma vie, j&#39;ai remarqu&eacute; que notre gouvernement ne pouvait pas offrir des emplois &agrave; tous malgr&eacute; leurs efforts! Nos attentes &eacute;taient devenues courtes lorsque nous avions termin&eacute; les &eacute;tudes. J&#39;&eacute;tais &eacute;nerv&eacute; par le ch&ocirc;mage croissant dont j&#39;ai &eacute;t&eacute; t&eacute;moin! ... Une chose est que le gouvernement ne peut pas employer tous les citoyens d&#39;un pays, l&#39;autre est que nous ne pouvons pas nous employer par manque de moyens, le secteur priv&eacute; n&#39;est pas d&eacute;velopp&eacute;! ... ...</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Y a-t-il une solution &agrave; cela? Qui le sait? Quelqu&#39;un peut-il partager le secret? ....</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>En tant qu&rsquo;adolescent, j&#39;&eacute;tais perplexe aussi! J&#39;&eacute;tais frustr&eacute; mais incapable de faire quoi que ce soit! ......</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Plus tard, je suis venu en Am&eacute;rique. Quelque chose m&#39;a frapp&eacute; quand j&#39;ai atterri en Am&eacute;rique, la richesse de ce pays compar&eacute;e &agrave; mon pays! ... J&#39;ai imm&eacute;diatement commenc&eacute; &agrave; penser &agrave; ce qui a rendu l&#39;Am&eacute;rique riche, &agrave; ce qui a fait l&#39;Am&eacute;rique la 1&egrave;re puissance &eacute;conomique du monde! Quelque chose a retenu mon attention, savez-vous ce que c&#39;est? C&#39;est ce qui manque &agrave; l&#39;Afrique, c&#39;est l&#39;entrepreneuriat! Je suis convaincu que si nous pouvons apprendre &agrave; devenir des entrepreneurs en Afrique, nous pourrions r&eacute;soudre nos probl&egrave;mes financiers! ... Pourquoi? Parce que nous allons apprendre &agrave; survivre par nous-m&ecirc;mes, sans d&eacute;pendre de l&#39;aide ou des emplois du gouvernement. Ensuite, j&#39;ai commenc&eacute; &agrave; r&eacute;fl&eacute;chir &agrave; la mani&egrave;re dont je pouvais transf&eacute;rer l&#39;entrepreneuriat occidental en Afrique, le co&ucirc;t &eacute;tant le principal probl&egrave;me? ... C&#39;est ainsi que je suis arriv&eacute; &agrave; mettre en pieds l&#39;Opportunit&eacute; &laquo;4&raquo;!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>L&rsquo;opportunit&eacute; &laquo;4&raquo; est l&rsquo;entrepreneuriat occidental africanis&eacute; au point que les Africains n&rsquo;ont m&ecirc;me pas &agrave; payer pour y participer! C&#39;est gratuit pour eux! Je sais que nous n&rsquo;avons pas de moyens en Afrique, c&rsquo;est pourquoi je l&rsquo;ai fait de cette fa&ccedil;on!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Cette connaissance de manque de moyens en Afrique soul&egrave;ve une autre question in&eacute;vitable: &agrave; quoi servirait-il d&rsquo;enseigner gratuitement l&rsquo;entreprenariat aux Africains s&rsquo;ils ne peuvent l&rsquo;exercer faute de moyens? Un autre probl&egrave;me g&eacute;ant &agrave; r&eacute;soudre! ... Qui a une suggestion! ... En avez-vous une? .... Quoi? ....</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>J&#39;en ai une! J&#39;ai invent&eacute; une r&egrave;gle que j&#39;appelle &laquo;R&egrave;gle 20/20&raquo;. Cette r&egrave;gle, associ&eacute;e &agrave; une commission de 40% que je mets en place dans l&#39;Opportunit&eacute; &ldquo;4&rdquo;, permet de diss&eacute;miner ce probl&egrave;me apparemment &eacute;norme! ... Ce syst&egrave;me met en place un syst&egrave;me qui forme les Africains aux entrepreneurs gratuitement apr&egrave;s avoir mis d&#39;&eacute;normes commissions dans leurs poches!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Opportunity &ldquo;4&rdquo; met d&rsquo;&eacute;normes commissions dans les poches des Africains apr&egrave;s les avoir form&eacute;s en des entrepreneurs ce qui leur donne les moyens de mettre en pratique ce qu&rsquo;ils vont apprendre dans Opportunity &ldquo;4&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Probl&egrave;mes r&eacute;solus! ... Aux Africains de montrer ce qu&#39;ils ont! ....</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>L&rsquo;objectif est de d&eacute;velopper le secteur priv&eacute; en Afrique en la lib&eacute;rant de l&rsquo;id&eacute;e que le gouvernement a toutes les solutions! Au moment, nous devons survivre, en faisant quoi? En d&eacute;veloppant le secteur priv&eacute;, l&agrave; o&ugrave; Opportunity &ldquo;4&rdquo; devient incontournable! ...</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>Nous savons que nous avons beaucoup de talents et de &ldquo;cerveaux&rdquo; en Afrique, voici le moyen pour les d&eacute;velopper: l&rsquo;OPPORTUNITY &ldquo;4&rdquo;! ...</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Inscrivez-vous aujourd&#39;hui et voyez par vous-m&ecirc;me cette r&eacute;volution!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, 'PAGE', 'NO SIDEBAR', '2018-12-24 05:48:03', '2018-12-24 05:48:03', 'fr'),
(18, 'PUBLISHED', NULL, '2A We Pay Your Monthly Fees', '2a-we-pay-your-monthly-fees', '<p>How do we pay your monthly fees? Look at this calculation!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Opportunity &quot;4&quot;</p>\r\n\r\n<p>Rule 20/20</p>\r\n\r\n<p>Fees: 1 000F/month</p>\r\n\r\n<p>Benefits: 40%</p>\r\n\r\n<p>There 4 levels of benefits</p>\r\n\r\n<p>16 842 000F</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4) 8 000p x 20p = 160 000p; 160 000p x 1 000F = 160 000 000F; 160 000 000F x 10% = 16 000 000F</p>\r\n\r\n<p>3) 400p x 20p = 8 000p; 8 000p x 1 000F = 8 000 000F; 8 000 000F x 10% = 800 000F</p>\r\n\r\n<p>2) 20p x 20p = 400p; 400p x 1 000F = 400 000F; 400 000F x 10% = 40 000F</p>\r\n\r\n<p>1) 20p; 20p x 1 000F = 20 000F; 20 000F x 10% = 2 000F</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Total: 2 000F + 40 000F + 800 000F + 16 000 000F = 16 842 000F</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>This is the way we pay your monthly fees! If you apply our famous Rule 20/20, we will pay your monthly fees for you.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>In the calculation above, look at Level 1: applying Rule 20/20 means that you have to bring in Opportunity &ldquo;4&rdquo; 20 subscribers during your first 30 days and ask the subscribers in your group to bring also 30 subscribers in Opportunity &ldquo;4&rdquo; in their first 30 days.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>From the time you have 20 subscribers under you (these subscribers can be your own subscribers you bring in or subscribers brought in by the subscribers at your first 3 levels), if these subscribers pay their monthly fees regularly, we will be giving you back as commissions the double of your monthly fees, this allows you to pay your fees of the month and save another monthly fees every month.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Do you get it? At 20 subscribers at your 4 levels, we pay you as commissions at the end of that month, the double of your monthly fees, we reimburse you your last month fees and give you another month fees for you for the next month. If this happens in your first month in Opportunity &ldquo;4&rdquo; then you will never pay fees in Opportunity &ldquo;4&rdquo;!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Actually, at your 10th subscriber in your group, if they pay regularly their monthly fees, we reimburse you monthly your monthly fees, from the 11th subscriber in your group, you begin making money in Opportunity &ldquo;4&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For example, from the calculation above, the fees are 1 000F monthly, if you have 10 subscribers in your group and they paid their monthly fees, you will be having as commissions 1 000F (your monthly fees), at 20 subscribers, we pay you monthly 2 000F (double of your monthly fees).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This is the way we pay your monthly fees from your 10th subscriber in your group.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, 'PAGE', 'NO SIDEBAR', '2018-12-24 05:54:21', '2018-12-24 05:54:21', 'en'),
(19, 'PUBLISHED', NULL, '2A Nous Payons Vos Frais Mensuels', '2a-nous-payons-vos-frais-mensuels', '<p>Comment payons-nous vos frais mensuels? Regardez ce calcul!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Opportunity &quot;4&quot;</p>\r\n\r\n<p>R&egrave;gle 20/20</p>\r\n\r\n<p>Frais: 1 000F</p>\r\n\r\n<p>B&eacute;n&eacute;fices: 40%</p>\r\n\r\n<p>Il y a 4 niveaux de b&eacute;n&eacute;fices</p>\r\n\r\n<p>16 842 000F</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4) 8 000p x 20p = 160 000p; 160 000p x 1 000F = 160 000 000F; 160 000 000F x 10% = 16 000 000F</p>\r\n\r\n<p>3) 400p x 20p = 8 000p; 8 000p x 1 000F = 8 000 000F; 8 000 000F x 10% = 800 000F</p>\r\n\r\n<p>2) 20p x 20p = 400p; 400p x 1 000F = 400 000F; 400 000F x 10% = 40 000F</p>\r\n\r\n<p>1) 20p; 20p x 1 000F = 20 000F; 20 000F x 10% = 2 000F</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Total: 2 000F + 40 000F + 800 000F + 16 000 000F = 16 842 000F</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>C&#39;est ainsi que nous payons vos frais mensuels! Si vous appliquez notre c&eacute;l&egrave;bre r&egrave;gle 20/20, nous paierons vos frais mensuels pour vous.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dans le calcul ci-dessus, examinez le niveau 1: appliquer la r&egrave;gle 20/20 signifie que vous devez faire entrer 20 abonn&eacute;s dANS l&rsquo;opportunit&eacute; &laquo;4&raquo; pendant vos 30 premiers jours et demander aux abonn&eacute;s de votre groupe d&rsquo;amener &eacute;galement 30 abonn&eacute;s dans l&rsquo;Opportunit&eacute; &laquo;4&raquo; dans leurs 30 premiers jours.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&Agrave; partir du moment o&ugrave; vous avez 20 abonn&eacute;s sous vous (ces abonn&eacute;s peuvent &ecirc;tre vos propres abonn&eacute;s que vous avez amen&eacute;s dans l&#39;Opportunit&eacute; &ldquo;4&rdquo; ou des abonn&eacute;s amen&eacute;s par les abonn&eacute;s de vos 3 premiers niveaux), si ces abonn&eacute;s payent leurs frais mensuels r&eacute;guli&egrave;rement, nous allons vous payer le double de vos frais mensuels, cela vous permet de payer vos frais du mois et d&#39;&eacute;conomiser l&rsquo;autre frais mensuel suppl&eacute;mentaire chaque mois.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Avez-vous compris? &Agrave; 20 abonn&eacute;s dans vos 4 niveaux, nous vous payons le double de vos frais mensuels, nous vous remboursons les frais du dernier mois et vous versons un autre mois pour vous. Si cela se produit pendant votre premier mois dans l&#39;Opportunit&eacute; &laquo;4&raquo;, vous ne paierez jamais de frais dans l&#39;opportunit&eacute; &laquo;4&raquo;!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>En fait, &agrave; partir de votre 10&egrave;me abonn&eacute; dans votre groupe, s&rsquo;ils paient r&eacute;guli&egrave;rement leurs frais mensuels, nous vous remboursons mensuellement vos frais mensuels; &agrave; partir du 11&egrave;me abonn&eacute; de votre groupe, vous commencez &agrave; gagner de l&rsquo;argent dans l&rsquo;Opportunit&eacute; &laquo;4&raquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Par exemple, d&#39;apr&egrave;s le calcul ci-dessus, les frais sont de 1 000F par mois. Si vous avez 10 membres dans votre groupe et qu&#39;ils ont pay&eacute; leurs frais mensuels, vous recevrez des commissions de 1 000F (vos frais mensuels), &agrave; 20 abonn&eacute;s, nous vous paierons mensuellement. 2 000F (le double de vos frais mensuels) etc...</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>C&rsquo;est ainsi que nous payons vos frais mensuels &agrave; partir de votre 10&egrave;me abonn&eacute; de votre groupe.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, 'PAGE', 'NO SIDEBAR', '2018-12-24 05:56:17', '2018-12-24 05:56:17', 'fr'),
(20, 'PUBLISHED', NULL, 'How to pay on Opportunity 4', 'how-to-pay-on-opportunity-4', '<p>Content coming soon ........ before the end of the month!</p>', 1, 1, 'PAGE', 'NO SIDEBAR', '2019-02-19 05:47:33', '2019-02-19 06:12:35', 'en'),
